(31, '23', 'easy 2', 'tampilkan semua data mahasiswa', 'select * from mahasiswa', '2015-12-11 19:08:02', '0000-00-00 00:00:00', '2015-12-11 19:08:02'),
(32, '23', 'medium ', 'tampilkan data mahasiswa yang tidak lulus', 'select m.nama, f.nilai_huruf , mt.mata_kuliah, mt.nilai_min\r\nfrom mahasiswa m, frs f, mk_tawar mk, matakuliah mt\r\nwhere f.nilai_huruf > mt.nilai_min and f.nrp= m.nrp and f.id_mk_tawar= mk.id_mk_tawar and mk.id_mk= mt.id_mk and mk.semester=''1'' ;', '2015-12-11 19:07:43', '0000-00-00 00:00:00', '2015-12-11 19:07:43'),
(33, '25', 'Easy 1', '', 'SELECT *\r\nFROM MAHASISWA\r\nWHERE TO_CHAR( TGL_LHR, ''mm'' ) = ''04'' AND UPPER(TEMPAT_LHR) LIKE ''%PROBOLINGGO''', NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(34, '25', 'Easy 2', '', 'select DISTINCT D.NAMA\nfrom DOSEN D,  MK_TAWAR M,  MATAKULIAH MK\nwhere D.NIP = M.NIP\nand M.ID_MK = MK.ID_MK\nand M.JADWAL = ''Rabu''\nand MK.ID_MK = ''IF1409'';', NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(35, '25', 'Medium 1', '', 'SELECT distinct MAHASISWA.NAMA \n	FROM DOSEN, MK_TAWAR, FRS, MAHASISWA \n	WHERE 	DOSEN.NIP = MK_TAWAR.NIP AND \n		MK_TAWAR.ID_MK_TAWAR = FRS.ID_MK_TAWAR AND \n		FRS.NRP = MAHASISWA.NRP AND \n		DOSEN.NAMA LIKE ''%Rully%''\n	ORDER BY MAHASISWA.NAMA;\n', NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(36, '25', 'Medium 2', '', 'SELECT DISTINCT DOSEN.NAMA\nFROM DOSEN, MK_TAWAR, FRS\nWHERE DOSEN.NIP = MK_TAWAR.NIP AND FRS.ID_MK_TAWAR = MK_TAWAR.ID_MK_TAWAR AND FRS.NILAI_HURUF = ''B''\nORDER BY DOSEN.NAMA ASC', NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(37, '25', 'Hard 1', '', 'SELECT NAMA FROM MAHASISWA, ( 	SELECT SEMESTER, TAHUN, FRS.NRP, SUM(MATAKULIAH.SKS)  	FROM FRS, MK_TAWAR, MATAKULIAH  	WHERE FRS.ID_MK_TAWAR = MK_TAWAR.ID_MK_TAWAR AND MK_TAWAR.ID_MK =   MATAKULIAH.ID_MK  	GROUP BY SEMESTER, TAHUN, FRS.NRP 	HAVING SUM(MATAKULIAH.SKS) > 18 ) X WHERE X.SEMESTER = 2 AND X.TAHUN = 2001 AND MAHASISWA.NRP = X.NRP ORDER BY NAMA ASC;', NULL, '0000-00-00 00:00:00', '2015-12-11 04:37:39'),
(38, '26', 'E1', '', '', NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(39, '26', 'E2', '', '', NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
