(41, '26', 'M2', '', '', NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(42, '26', 'Happy Coding :)', '', '', NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(43, '27', 'Easy 1', '', 'select * from mahasiswa', NULL, '0000-00-00 00:00:00', '2015-12-11 06:38:17'),
(44, '28', 'asdf', '', 'select * from mahasiswa', NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(45, '29', '1', '', 'select * from mahasiswa', NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(46, '29', 'ayayayay', '', 'SELECT DISTINCT m.nama, (SELECT COUNT(1) FROM frs f WHERE f.nrp=m.nrp AND f.nilai_huruf=''A'') AS Nilai_A FROM mahasiswa m, frs f  WHERE m.nama LIKE ''%ATMA%'' AND m.nrp=f.nrp;', NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(47, '30', 'Easy 1', 'Tampilkan nama setiap mahasiswa yang memiliki kata “atma” pada namanya (tak peduli ada di depan, di belakang, atau di antara kalimat), kemudian hitung berapa jumlah nilai A yang mereka dapat, ditampilkan berurut sesuai nama mahasiswa', 'SELECT DISTINCT m.nama, (SELECT COUNT(1) FROM frs f WHERE f.nrp=m.nrp AND f.nilai_huruf=''A'') AS Nilai_A FROM mahasiswa m, frs f  WHERE m.nama LIKE ''%ATMA%'' AND m.nrp=f.nrp order by m.nama', NULL, '0000-00-00 00:00:00', '2015-12-11 07:40:30'),
(48, '30', 'Easy 2', 'Tampilkan nama dan nilai huruf dari mahasiswa yang PERNAH mengambil kelas “Praktikum Sistem Digital” pada tahun 2002 di kelas E, dan beragama Hindu (Kode 4) atau Buddha (Kode 5), diurutkan berdasarkan nama mahasiswa', 'SELECT m.nama, f.nilai_huruf FROM mahasiswa m, frs f WHERE f.nrp=m.nrp AND f.id_mk_tawar=''imt1002''  AND (Agama=''4'' OR AGAMA=''5'') order by m.nama', NULL, '0000-00-00 00:00:00', '2015-12-11 21:41:46'),
(49, '30', 'Medium 1', 'Tampilkan ID_MK_Tawar, nama Mata Kuliah, dan Tahun untuk Kelas (MK_Tawar) yang memiliki daya tampung di bawah rata-rata kelas-kelas yang lain (Semua tahun dan semester), diurutkan berdasarkan ID_MK_Tawar', 'SELECT mkt.id_mk_tawar, mk.mata_kuliah, mkt.tahun FROM mk_tawar mkt, matakuliah mk WHERE mkt.id_mk=mk.id_mk AND mkt.daya_tampung < (SELECT AVG(daya_tampung) FROM mk_tawar) order by mkt.id_mk_tawar', NULL, '0000-00-00 00:00:00', '2015-12-12 00:29:07'),
(50, '30', 'Medium 2', 'Tampilkan ID_MK_Tawar, NIP, serta Nama Dosen Pengajarnya yang menawarkan kelas “Pemrograman Berbasis Web” dan jumlah pesertanya mencapai 80% dari kapasitas kelasnya diurutkan berdasarkan ID_MK_Tawar', 'SELECT mkt.id_mk_tawar, mkt.nip, (SELECT nama FROM dosen d WHERE mkt.nip=d.nip) AS Nama_Dosen FROM mk_tawar mkt WHERE mkt.id_mk =''IF1535'' AND mkt.terisi>=(mkt.daya_tampung*80/100) order by mkt.id_mk_tawar', NULL, '0000-00-00 00:00:00', '2015-12-11 21:45:14'),
(51, '30', 'がんばります、みんな！ ( ／・∀・)／', 'Tampilkan ID_MK_Tawar, Nama, Nilai Huruf serta Dosen Pengajarnya (Sebut saja  “DOSEN_PENGAJAR”) dari Mahasiswa Laki-Laki yang mendapat nilai lebih dari B pada kelas Sistem Operasi, disusun berdasarkan DOSEN_PENGAJAR', 'SELECT DISTINCT f.id_mk_tawar, f.nrp, f.nilai_huruf, (select d.nama from dosen d where d.nip= mkt.nip) as DOSEN_PENGAJAR FROM frs f, mahasiswa m, mk_tawar mkt WHERE mkt.id_mk=''IF1412'' AND (SELECT n.nilai_angka FROM nilai n WHERE f.nilai_huruf=n.nilai_huruf)>(SELECT n.nilai_angka FROM nilai n WHERE nilai_huruf=''B'') AND m.nrp=f.nrp AND mkt.id_mk_tawar=f.id_mk_tawar AND m.jk=''L'' ORDER BY DOSEN_PENGAJAR', NULL, '0000-00-00 00:00:00', '2015-12-11 22:19:00'),
(52, '25', 'cobaaa', '', 'select mk_tawar.tahun, mk_tawar.semester, count(frs.nrp) as jumlah_siswa, count(mk_tawar.kelas) as jumlahkelas \r\nfrom mk_tawar, frs, matakuliah \r\nwhere mk_tawar.id_mk_tawar = frs.id_mk_tawar and mk_tawar.id_mk = matakuliah.id_mk and matakuliah.nilai_min < ''D'' and MOD(mk_tawar.tahun,2) = 1\r\ngroup by mk_tawar.tahun, mk_tawar.semester\r\norder by mk_tawar.TAHUN;', '2015-12-11 10:17:09', '0000-00-00 00:00:00', '2015-12-11 10:17:09'),
(53, '25', 'coba 2', '', 'select f.nrp , m.nama\r\nfrom frs f, mahasiswa m, mk_tawar t, matakuliah k\r\nwhere f.nrp = m.nrp and f.id_mk_tawar = t.id_mk_tawar\r\n	and t.id_mk = k.id_mk and substr(f.nrp,3, 2) =01\r\n	and f.id_mk_tawar IN\r\n		(select t.id_mk_tawar\r\n		 from mk_tawar t, matakuliah m\r\n		 where t.id_mk = m.id_mk and m.mata_kuliah = ''BASIS DATA'')\r\n	and f.id_mk_tawar NOT IN\r\n		(select t.id_mk_tawar\r\n		 from mk_tawar t, matakuliah m\r\n		 where t.id_mk = m.id_mk and m.mata_kuliah = ''BASIS DATA TERDISTRIBUSI'');', '2015-12-11 10:17:13', '0000-00-00 00:00:00', '2015-12-11 10:17:13'),
(54, '25', 'coba 3', '', 'select f.nrp\r\nfrom frs f, mahasiswa m, mk_tawar t, matakuliah k\r\nwhere f.nrp = m.nrp and f.id_mk_tawar = t.id_mk_tawar\r\n	and t.id_mk = k.id_mk and TO_NUMBER(substr(f.nrp,3, 2),''99'') > 94 and TO_NUMBER(substr(f.nrp,3, 2),''99'') < 99\r\n	and ( f.id_mk_tawar IN\r\n		(select t.id_mk_tawar\r\n		 from mk_tawar t, matakuliah m\r\n		 where t.id_mk = m.id_mk and m.mata_kuliah = ''BASIS DATA'')\r\n	or f.id_mk_tawar IN\r\n		(select t.id_mk_tawar\r\n		 from mk_tawar t, matakuliah m\r\n		 where t.id_mk = m.id_mk and m.mata_kuliah = ''BASIS DATA TERDISTRIBUSI''))\r\ngroup by f.NRP', '2015-12-11 10:17:17', '0000-00-00 00:00:00', '2015-12-11 10:17:17'),
(55, '25', 'coba 4', '', 'select NAMA, TGL_LHR\r\nfrom MAHASISWA\r\nwhere NRP in (select NRP \r\n              from FRS\r\n              where ID_MK_TAWAR not in (select ID_MK \r\n                                  from MK_TAWAR \r\n                                  where NIP not in (select NIP \r\n                                                    from MK_TAWAR\r\n                                                    where KELAS = ''A'')\r\n                                  and NIP in (select NIP \r\n                                              from MK_TAWAR\r\n                                              where DAYA_TAMPUNG > (select avg(DAYA_TAMPUNG) \r\n                                                                    from MK_TAWAR \r\n                                                                    where SEMESTER = 2))))\r\nand EXTRACT(YEAR from TGL_LHR) < 1985\r\norder by NAMA;', '2015-12-11 10:17:05', '0000-00-00 00:00:00', '2015-12-11 10:17:05'),
(56, '25', 'coba 5', '', 'select mk_tawar.tahun, mk_tawar.semester, count(frs.nrp) as jumlah_siswa, count(mk_tawar.kelas) as jumlahkelas \r\nfrom mk_tawar, frs, matakuliah \r\nwhere mk_tawar.id_mk_tawar = frs.id_mk_tawar and mk_tawar.id_mk = matakuliah.id_mk and matakuliah.mata_kuliah LIKE ''JARINGAN%'' \r\ngroup by mk_tawar.tahun, mk_tawar.semester\r\norder by mk_tawar.tahun;', '2015-12-11 10:17:02', '0000-00-00 00:00:00', '2015-12-11 10:17:02'),
(57, '31', 'aa', 'aaa', 'select * from dosen', NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(58, '32', 'easy 1', 'Tampilkan NRP,nama, dan Tempat lahir mahasiwa yang mendapatkan nilai E pada FRS urutkan berdasarkan NRP secara descending', 'select distinct f.nrp, m.nama, m.tempat_lhr\nfrom mahasiswa m, frs f\nwhere m.NRP = f.NRP\nand nilai_huruf = ''E''\norder by f.NRP DESC;', NULL, '0000-00-00 00:00:00', '2015-12-11 19:15:06'),
(59, '32', 'easy 2', 'Tampilkan semua data dosen yang mengajar mata kuliah SISTEM INFORMASI urutkan berdasarkan NIP secara ascending', 'select distinct d.*\nfrom dosen d, mk_tawar mkt\nwhere d.NIP = mkt.NIP\nand mkt.ID_MK in (select ID_MK from matakuliah where mata_kuliah = ''SISTEM INFORMASI'')\norder by d.NIP ASC', NULL, '0000-00-00 00:00:00', '2015-12-11 18:16:43'),
(60, '32', 'medium 1', 'Tampilkan semua data mahasiswa yang mengambil mata kuliah ARSITEKTUR KOMPUTER yang diajar oleh Ibu Sarwosri, S.Kom urutkan berdasarkan NRP secara ascending', 'select distinct m.*\nfrom mahasiswa m, dosen d, matakuliah mk, mk_tawar mkt, frs f\nwhere m.NRP = f.NRP\nand f.ID_MK_TAWAR = mkt.ID_MK_TAWAR\nand mk.ID_MK = mkt.ID_MK\nand d.NIP = mkt.NIP\nand mk.ID_MK in (select ID_MK from matakuliah where mata_kuliah = ''ARSITEKTUR KOMPUTER'')\nand d.NIP = (select NIP from dosen where nama LIKE ''%Sarwosri%'' )\norder by m.NRP ASC', NULL, '0000-00-00 00:00:00', '2015-12-11 18:16:57'),
(61, '32', 'medium 2', 'Tampilkan nrp mahasiswa malas(tidak pernah mengambil FRS selama kuliah) dan lahir di MALANG(KOTA MALANG DAN KABUPATEN MALANG) TERURUT SESUAI NRP DESCENCDING)', 'SELECT NRP\nFROM MAHASISWA\nWHERE NRP NOT IN (\n	SELECT MAHASISWA.NRP \n	FROM MAHASISWA, FRS, MK_TAWAR\n	WHERE MAHASISWA.NRP = FRS.NRP AND MK_TAWAR.ID_MK_TAWAR = FRS.ID_MK_TAWAR\n) AND UPPER(MAHASISWA.TEMPAT_LHR) LIKE ''%MALANG%''\nORDER BY NRP DESC', NULL, '0000-00-00 00:00:00', '2015-12-12 06:01:39'),
(62, '35', 'ssss', '', 'select * from dosen', NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(63, '32', 'hard 1', 'Tampilkan semua data mata kuliah beserta nilai hurufnya pada data FRS yang memiliki nilai angka di atas rata-rata nilai angka pada data nilai serta urutkan berdasarkan ID mata kuliah secara ascending dan berdasarkan nilai huruf secara descending, dan jang', 'select distinct mk.*, f.nilai_huruf\r\nfrom matakuliah mk, mk_tawar mkt, frs f\r\nwhere mk.ID_MK = mkt.ID_MK\r\nand mkt.ID_MK_TAWAR = f.ID_MK_TAWAR\r\nand f.NILAI_HURUF in (select NILAI_HURUF from NILAI where nilai_angka > (select avg(nilai_angka) from nilai))\r\norder by mk.ID_MK ASC, f.nilai_huruf DESC;', NULL, '0000-00-00 00:00:00', '2015-12-11 18:17:20'),
(64, '40', '1', '', 'select mk_tawar.tahun, mk_tawar.semester, count(frs.nrp) as jumlah_siswa, count(mk_tawar.kelas) as jumlahkelas \r\nfrom mk_tawar, frs, matakuliah \r\nwhere mk_tawar.id_mk_tawar = frs.id_mk_tawar and mk_tawar.id_mk = matakuliah.id_mk and matakuliah.mata_kuliah LIKE ''JARINGAN%'' \r\ngroup by mk_tawar.tahun, mk_tawar.semester\r\norder by mk_tawar.tahun;', NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(65, '40', '2', '', 'select mk_tawar.tahun, mk_tawar.semester, count(frs.nrp) as jumlah_siswa, count(mk_tawar.kelas) as jumlahkelas \r\nfrom mk_tawar, frs, matakuliah \r\nwhere mk_tawar.id_mk_tawar = frs.id_mk_tawar and mk_tawar.id_mk = matakuliah.id_mk and matakuliah.nilai_min < ''D'' and MOD(mk_tawar.tahun,2) = 1\r\ngroup by mk_tawar.tahun, mk_tawar.semester\r\norder by mk_tawar.TAHUN;', NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(66, '40', '3', '', 'select f.nrp , m.nama\r\nfrom frs f, mahasiswa m, mk_tawar t, matakuliah k\r\nwhere f.nrp = m.nrp and f.id_mk_tawar = t.id_mk_tawar\r\n	and t.id_mk = k.id_mk and substr(f.nrp,3, 2) =01\r\n	and f.id_mk_tawar IN\r\n		(select t.id_mk_tawar\r\n		 from mk_tawar t, matakuliah m\r\n		 where t.id_mk = m.id_mk and m.mata_kuliah = ''BASIS DATA'')\r\n	and f.id_mk_tawar NOT IN\r\n		(select t.id_mk_tawar\r\n		 from mk_tawar t, matakuliah m\r\n		 where t.id_mk = m.id_mk and m.mata_kuliah = ''BASIS DATA TERDISTRIBUSI'');', NULL, '0000-00-00 00:00:00', '2015-12-11 18:48:22'),
(67, '40', '4', '', 'select f.nrp\r\nfrom frs f, mahasiswa m, mk_tawar t, matakuliah k\r\nwhere f.nrp = m.nrp and f.id_mk_tawar = t.id_mk_tawar\r\n	and t.id_mk = k.id_mk and (substr(f.nrp,3, 2) = 98 or substr(f.nrp,3, 2) = 01 or substr(f.nrp,3, 2) = 00 or substr(f.nrp,3, 2) = 02)\r\n	and ( f.id_mk_tawar IN\r\n		(select t.id_mk_tawar\r\n		 from mk_tawar t, matakuliah m\r\n		 where t.id_mk = m.id_mk and m.mata_kuliah = ''BASIS DATA'')\r\n	and f.NRP IN\r\n		(select t.NRP\r\n		 from FRS t\r\n		 where t.NILAI_HURUF < ''C'' and t.ID_MK_TAWAR = ''imt1007''))\r\ngroup by f.NRP\r\nORDER BY f.NRP;', NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(68, '40', '5', '', 'select NAMA, TGL_LHR\r\nfrom MAHASISWA\r\nwhere NRP in (select NRP \r\n              from FRS\r\n              where ID_MK_TAWAR not in (select ID_MK \r\n                                  from MK_TAWAR \r\n                                  where NIP not in (select NIP \r\n                                                    from MK_TAWAR\r\n                                                    where KELAS = ''A'')\r\n                                  and NIP in (select NIP \r\n                                              from MK_TAWAR\r\n                                              where DAYA_TAMPUNG > (select avg(DAYA_TAMPUNG) \r\n                                                                    from MK_TAWAR \r\n                                                                    where SEMESTER = 2))))\r\nand EXTRACT(YEAR from TGL_LHR) < 1985\r\norder by NAMA;\r\n', NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(69, '23', 'Test', 'Tampilkan semua data Dosen', 'select * from dosen', NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(70, '41', 'Easy 1', 'Tampilkan semua data dosen yang mengajar mahasiswa dengan nama mahasiswa yang huruf keempat = U\r\ndiurutkan berdasar nip dosen ascending', 'select d.*\r\nfrom dosen d, mk_tawar mk, frs f\r\nwhere d.nip = mk.nip and mk.id_mk_tawar= f.id_mk_tawar and f.nrp in(select nrp from mahasiswa where mahasiswa.nama like ''___u%'')\r\norder by d.nip asc', NULL, '0000-00-00 00:00:00', '2015-12-11 21:55:15'),
(71, '41', 'Easy 2', 'Tampilkan nama mahasiswa,nilai huruf mahasiswa, nama matakuliah dan  nilai huruf minimal, untuk mahasiswa yang tidak lulus dalam matakuliah yang di ambil dalam semester 1 diurutkan berdasarkan nama mahasiswa ascending', 'select m.nama, f.nilai_huruf , mt.mata_kuliah, mt.nilai_min\r\nfrom mahasiswa m, frs f, mk_tawar mk, matakuliah mt\r\nwhere f.nilai_huruf > mt.nilai_min and f.nrp= m.nrp and f.id_mk_tawar= mk.id_mk_tawar and mk.id_mk= mt.id_mk and mk.semester=''1'' and f.nilai_huruf > mt.nilai_min\r\norder by m.nama asc', NULL, '0000-00-00 00:00:00', '2015-12-11 23:01:16'),
(72, '41', 'Medium 1', 'Tampilkan semua data dosen yang mengajar mahasiswa yang mengambil matakuliah IF1409 dengan nilai_huruf b diurutkan berdasan nip dosen ascending', 'select *\r\nfrom dosen\r\nwhere nip in (\r\nselect mk.nip\r\nfrom mahasiswa m, frs f, mk_tawar mk\r\nwhere m.nrp=f.nrp and f.nilai_huruf=''B'' and mk.id_mk=''IF1409'' and f.id_mk_tawar= mk.id_mk_tawar)\r\norder by nip asc', NULL, '0000-00-00 00:00:00', '2015-12-11 20:05:08'),
(73, '41', 'Masih Medium', 'Tampilkan semua data matakuliah tawar yang di ambil mahasiswa yang lahir di bulan ke 9 diurutkan berdasarkan ID MK Tawar ascending', 'select mk.*\r\nfrom mk_tawar mk, frs f, mahasiswa m\r\nwhere mk.id_mk_tawar= f.id_mk_tawar and m.nrp=f.nrp and m.nrp in (\r\n  select mahasiswa.nrp \r\n  from mahasiswa\r\n  where extract(month from tgl_lhr)=''9'')\r\norder by f.id_mk_tawar asc\r\n', NULL, '0000-00-00 00:00:00', '2015-12-11 23:16:50'),
(74, '41', 'BIASA HARD', 'Tampilkan nrp dan ips mahasiswa yg nilai ips semester 2 tahun 2001 lebih dari rata rata ips mahasiswa pada semester dan tahun yang sama . \r\nPerhitungan IPS = jumlah (nilai yang didapatkan * sks matakuliah tersebut) / jumlah matakuliah yang diambil\r\ndiurutkan berdasarkan IPS secara ascending', 'select f.nrp as nrp,sum(n.nilai_angka*m.sks)/sum(m.sks) as ips\r\nfrom nilai n, frs f, mk_tawar mk, matakuliah m\r\nwhere mk.id_mk_tawar = f.id_mk_tawar and f.nilai_huruf= n.nilai_huruf and mk.id_mk=m.id_mk and mk.semester=''2'' and mk.tahun=''2001''\r\ngroup by f.nrp\r\nhaving sum(n.nilai_angka*m.sks)/sum(m.sks) > (select avg(s.ips) from ( select sum(n.nilai_angka*m.sks)/sum(m.sks) as ips from nilai n, frs f, mk_tawar mk, matakuliah m where mk.id_mk_tawar = f.id_mk_tawar and f.nilai_huruf= n.nilai_huruf and mk.id_mk=m.id_mk and mk.semester=''2'' and mk.tahun=''2001'' group by f.nrp) s)\r\norder by ips asc', NULL, '0000-00-00 00:00:00', '2015-12-12 00:47:04'),
(75, '43', 'Lalalalala', '', 'select * from mahasiswa order by nrp;', NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(76, '43', 'Hardcore AF.', '', 'SELECT DISTINCT m.nama, (SELECT COUNT(1) FROM frs f WHERE f.nrp=m.nrp AND f.nilai_huruf=''A'') AS Nilai_A FROM mahasiswa m, frs f  WHERE m.nama LIKE ''%ATMA%'' AND m.nrp=f.nrp order by m.nama', NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(77, '44', 'Hardcore AF.', '', 'select * from mahasiswa order by nama;', NULL, '0000-00-00 00:00:00', '2015-12-11 21:40:26'),
(78, '44', 'Handsome Me.', '', 'SELECT m.nama, f.nilai_huruf FROM mahasiswa m, frs f WHERE f.nrp=m.nrp AND f.id_mk_tawar=''imt1002''  AND (Agama=''4'' OR AGAMA=''5'') order by m.nama', NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(79, '44', '私の心', '', 'SELECT mkt.id_mk_tawar, mk.mata_kuliah, mkt.tahun FROM mk_tawar mkt, matakuliah mk WHERE mkt.id_mk=mk.id_mk AND mkt.daya_tampung < (SELECT AVG(daya_tampung) FROM mk_tawar) order by mkt.id_mk_tawar', NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(80, '44', 'Hahahahaha', '', 'SELECT mkt.id_mk_tawar, mkt.nip, (SELECT nama FROM dosen d WHERE mkt.nip=d.nip) AS Nama_Dosen FROM mk_tawar mkt WHERE mkt.id_mk =''IF1535'' AND mkt.terisi>=(mkt.daya_tampung*80/100) order by mkt.id_mk_tawar', NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(81, '44', 'Time to weeb', '', 'SELECT DISTINCT mkt.id_mk_tawar, m.nrp, f.nilai_huruf, (select d.nama from dosen d where d.nip= mkt.nip) as DOSEN_PENGAJAR FROM frs f, mahasiswa m, mk_tawar mkt\r\nWHERE mkt.id_mk=''IF1412''\r\nAND (SELECT n.nilai_angka FROM nilai n WHERE f.nilai_huruf=n.nilai_huruf)>(SELECT n.nilai_angka FROM nilai n WHERE nilai_huruf=''B'')\r\nAND m.nrp=f.nrp AND mkt.id_mk_tawar=f.id_mk_tawar AND m.jk=''L''\r\nORDER BY mkt.id_mk_tawar', '2015-12-11 21:47:46', '0000-00-00 00:00:00', '2015-12-11 21:47:46'),
(82, '44', 'Aduuuh', '', 'SELECT DISTINCT mkt.id_mk_tawar, m.nrp, f.nilai_huruf, (select d.nama from dosen d where d.nip= mkt.nip)FROM frs f, mahasiswa m, mk_tawar mkt\r\nWHERE mkt.id_mk=''IF1412''\r\nAND (SELECT n.nilai_angka FROM nilai n WHERE f.nilai_huruf=n.nilai_huruf)>(SELECT n.nilai_angka FROM nilai n WHERE nilai_huruf=''B'')\r\nAND m.nrp=f.nrp AND mkt.id_mk_tawar=f.id_mk_tawar AND m.jk=''L''\r\nORDER BY mkt.id_mk_tawar', '2015-12-11 21:50:01', '0000-00-00 00:00:00', '2015-12-11 21:50:01'),
(83, '44', 'Aduuuh v2', '', 'SELECT DISTINCT f.id_mk_tawar, m.nrp, f.nilai_huruf, (select d.nama from dosen d where d.nip= mkt.nip)FROM frs f, mahasiswa m, mk_tawar mkt\r\nWHERE mkt.id_mk=''IF1412''\r\nAND (SELECT n.nilai_angka FROM nilai n WHERE f.nilai_huruf=n.nilai_huruf)>(SELECT n.nilai_angka FROM nilai n WHERE nilai_huruf=''B'')\r\nAND m.nrp=f.nrp AND mkt.id_mk_tawar=f.id_mk_tawar AND m.jk=''L''\r\nORDER BY f.id_mk_tawar', '2015-12-11 21:53:15', '0000-00-00 00:00:00', '2015-12-11 21:53:15'),
(84, '44', 'ADuuh v3', '', 'SELECT DISTINCT f.id_mk_tawar, m.nrp, f.nilai_huruf, (select d.nama from dosen d where d.nip= mkt.nip)FROM frs f, mahasiswa m, mk_tawar mkt\r\nWHERE mkt.id_mk=''IF1412''\r\nAND (SELECT n.nilai_angka FROM nilai n WHERE f.nilai_huruf=n.nilai_huruf)>(SELECT n.nilai_angka FROM nilai n WHERE nilai_huruf=''B'')\r\nAND m.nrp=f.nrp AND mkt.id_mk_tawar=f.id_mk_tawar AND m.jk=''L''\r\nORDER BY f.id_mk_tawar', '2015-12-11 21:54:05', '0000-00-00 00:00:00', '2015-12-11 21:54:05'),
(85, '44', 'Aduuh V6', '', 'SELECT DISTINCT f.id_mk_tawar, f.nrp, f.nilai_huruf, (select d.nama from dosen d where d.nip= mkt.nip) FROM frs f, mahasiswa m, mk_tawar mkt WHERE mkt.id_mk=''IF1412'' AND (SELECT n.nilai_angka FROM nilai n WHERE f.nilai_huruf=n.nilai_huruf)>(SELECT n.nilai_angka FROM nilai n WHERE nilai_huruf=''B'') AND m.nrp=f.nrp AND mkt.id_mk_tawar=f.id_mk_tawar AND m.jk=''L'' ORDER BY f.id_frs;', '2015-12-11 22:03:04', '0000-00-00 00:00:00', '2015-12-11 22:03:04'),
(86, '44', 'ffsasaf', '', 'SELECT DISTINCT f.id_mk_tawar, f.nrp, f.nilai_huruf FROM frs f, mahasiswa m, mk_tawar mkt WHERE mkt.id_mk=''IF1412'' AND (SELECT n.nilai_angka FROM nilai n WHERE f.nilai_huruf=n.nilai_huruf)>(SELECT n.nilai_angka FROM nilai n WHERE nilai_huruf=''B'') AND m.nrp=f.nrp AND mkt.id_mk_tawar=f.id_mk_tawar AND m.jk=''L'' ORDER BY f.id_mk_tawar;', '2015-12-11 22:06:10', '0000-00-00 00:00:00', '2015-12-11 22:06:10'),
(87, '44', 'dadsafafafa', '', 'SELECT DISTINCT f.id_mk_tawar, f.nrp, f.nilai_huruf, (select d.nama from dosen d where d.nip= mkt.nip) as DOSEN_PENGAJAR FROM frs f, mahasiswa m, mk_tawar mkt WHERE mkt.id_mk=''IF1412'' AND (SELECT n.nilai_angka FROM nilai n WHERE f.nilai_huruf=n.nilai_huruf)>(SELECT n.nilai_angka FROM nilai n WHERE nilai_huruf=''B'') AND m.nrp=f.nrp AND mkt.id_mk_tawar=f.id_mk_tawar AND m.jk=''L'' ORDER BY DOSEN_PENGAJAR', '2015-12-11 22:09:53', '0000-00-00 00:00:00', '2015-12-11 22:09:53'),
(88, '44', 'dvdagfgaf', '', 'SELECT DISTINCT f.id_mk_tawar, f.nrp, f.nilai_huruf, (select d.nama from dosen d where d.nip= mkt.nip) as DOSEN_PENGAJAR FROM frs f, mahasiswa m, mk_tawar mkt WHERE mkt.id_mk=''IF1412'' AND (SELECT n.nilai_angka FROM nilai n WHERE f.nilai_huruf=n.nilai_huruf)>(SELECT n.nilai_angka FROM nilai n WHERE nilai_huruf=''B'') AND m.nrp=f.nrp AND mkt.id_mk_tawar=f.id_mk_tawar AND m.jk=''L'' ORDER BY DOSEN_PENGAJAR', '2015-12-11 22:12:01', '0000-00-00 00:00:00', '2015-12-11 22:12:01'),
(89, '44', 'Cobaaaaa', '', 'SELECT DISTINCT mkt.id_mk_tawar, m.nrp, f.nilai_huruf, (select d.nama from dosen d where d.nip= mkt.nip) as DOSEN_PENGAJAR FROM frs f, mahasiswa m, mk_tawar mkt WHERE mkt.id_mk=''IF1412'' AND (SELECT n.nilai_angka FROM nilai n WHERE f.nilai_huruf=n.nilai_huruf)>(SELECT n.nilai_angka FROM nilai n WHERE nilai_huruf=''B'') AND m.nrp=f.nrp AND mkt.id_mk_tawar=f.id_mk_tawar AND m.jk=''L'' ORDER BY DOSEN_PENGAJAR', NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(90, '45', 'Soal 1', 'Tampilkan tahun, semester, jumlah siswa dan jumlah kelas yang ditawarkan untuk matakuliah yang berawal dengan kata JARINGAN. (10)', 'select mk_tawar.tahun, mk_tawar.semester, count(frs.nrp) as jumlah_siswa, count(mk_tawar.kelas) as jumlahkelas \r\nfrom mk_tawar, frs, matakuliah \r\nwhere mk_tawar.id_mk_tawar = frs.id_mk_tawar and mk_tawar.id_mk = matakuliah.id_mk and matakuliah.mata_kuliah LIKE ''JARINGAN%''\r\ngroup by mk_tawar.tahun, mk_tawar.semester\r\norder by mk_tawar.tahun;', NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(91, '45', 'Soal 2', 'Tampilkan tahun, semester, jumlah_siswa dan jumlah_kelas yang ditawarkan untuk matakuliah dengan nilai minimal D atau lebih pada tahun ganjil(15) urutkan berdasar tahun.', 'select mk_tawar.tahun, mk_tawar.semester, count(frs.nrp) as jumlah_siswa, count(mk_tawar.kelas) as jumlahkelas \r\nfrom mk_tawar, frs, matakuliah \r\nwhere mk_tawar.id_mk_tawar = frs.id_mk_tawar and mk_tawar.id_mk = matakuliah.id_mk and matakuliah.nilai_min < ''D'' and MOD(mk_tawar.tahun,2) = 1\r\ngroup by mk_tawar.tahun, mk_tawar.semester\r\norder by mk_tawar.TAHUN;', NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(92, '45', 'Soal 3', 'Tampilkan NRP, Nama Mahasiswa, dari mahasiswa angkatan 2001 yang mengambil basis data, tetapi belum mengambil basis data terdistribusi! (20)', 'select f.nrp , m.nama\r\nfrom frs f, mahasiswa m, mk_tawar t, matakuliah k\r\nwhere f.nrp = m.nrp and f.id_mk_tawar = t.id_mk_tawar\r\n	and t.id_mk = k.id_mk and substr(f.nrp,3, 2) =01\r\n	and f.id_mk_tawar IN\r\n		(select t.id_mk_tawar\r\n		 from mk_tawar t, matakuliah m\r\n		 where t.id_mk = m.id_mk and m.mata_kuliah = ''BASIS DATA'')\r\n	and f.id_mk_tawar NOT IN\r\n		(select t.id_mk_tawar\r\n		 from mk_tawar t, matakuliah m\r\n		 where t.id_mk = m.id_mk and m.mata_kuliah = ''BASIS DATA TERDISTRIBUSI'')\r\norder by f.nrp', NULL, '0000-00-00 00:00:00', '2015-12-12 00:18:20'),
(93, '45', 'Soal 4', 'Tampilkan nrp mahasiswa angkatan 1998 sampai 2002 yang mengambil basis data dan memiliki kode frs imt1007 dan memiliki nilai lebih dari C. urutkan berdasar nrp (20) urutkan berdasarkan nrp', 'select f.nrp\r\nfrom frs f, mahasiswa m, mk_tawar t, matakuliah k\r\nwhere f.nrp = m.nrp and f.id_mk_tawar = t.id_mk_tawar\r\n	and t.id_mk = k.id_mk and (substr(f.nrp,3, 2) = 98 or substr(f.nrp,3, 2) = 01 or substr(f.nrp,3, 2) = 00 or substr(f.nrp,3, 2) = 02)\r\n	and ( f.id_mk_tawar IN\r\n		(select t.id_mk_tawar\r\n		 from mk_tawar t, matakuliah m\r\n		 where t.id_mk = m.id_mk and m.mata_kuliah = ''BASIS DATA'')\r\n	and f.NRP IN\r\n		(select t.NRP\r\n		 from FRS t\r\n		 where t.NILAI_HURUF < ''C'' and t.ID_MK_TAWAR = ''imt1007''))\r\ngroup by f.NRP\r\nORDER BY f.NRP;', NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(94, '45', 'Soal 5', 'Tampilkan NAMA MAHASISWA dan TANGGAL LAHIR nya dimana mahasiswa-mahasiswa tersebut tidak mengambil mata kuliah dimana dosen pengajarnya tidak pernah mengajar di kelas A tapi mengajar di kelas yang memiliki daya tampung di atas rata-rata daya tampung di semester 2. (40)', 'select NAMA, TGL_LHR\r\nfrom MAHASISWA\r\nwhere NRP in (select NRP \r\n              from FRS\r\n              where ID_MK_TAWAR not in (select ID_MK \r\n                                  from MK_TAWAR \r\n                                  where NIP not in (select NIP \r\n                                                    from MK_TAWAR\r\n                                                    where KELAS = ''A'')\r\n                                  and NIP in (select NIP \r\n                                              from MK_TAWAR\r\n                                              where DAYA_TAMPUNG > (select avg(DAYA_TAMPUNG) \r\n                                                                    from MK_TAWAR \r\n                                                                    where SEMESTER = 2))))\r\nand EXTRACT(YEAR from TGL_LHR) < 1985\r\norder by NAMA;', NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00');
