(387, 34, 49, 0, 'SELECT DOSEN.NAMA\r\nFROM DOSEN, MK_TAWAR\r\nWHERE ID_MK IN\r\n	(SELECT ID_MK\r\n	FROM MATAKULIAH\r\n 	WHERE MATA_KULIAH = ''MATEMATIKA DISKRIT'')\r\nAND DOSEN.NIP = MK_TAWAR.NIP\r\nAND MK_TAWAR.JADWAL = ''Rabu''', 1, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(388, 34, 49, 0, 'SELECT D.NAMA\r\nFROM DOSEN D, MK_TAWAR MKT\r\nWHERE MKT.ID_MK IN\r\n	(SELECT ID_MK\r\n	FROM MATAKULIAH\r\n 	WHERE MATA_KULIAH = ''MATEMATIKA DISKRIT'')\r\nAND D.NIP = MKT.NIP\r\nAND MKT.JADWAL = ''Rabu''', 1, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(389, 34, 49, 0, 'SELECT DISTINCT D.NAMA\r\nFROM DOSEN D, MK_TAWAR MKT\r\nWHERE MKT.ID_MK IN\r\n	(SELECT ID_MK\r\n	FROM MATAKULIAH\r\n 	WHERE MATA_KULIAH = ''MATEMATIKA DISKRIT'')\r\nAND D.NIP = MKT.NIP\r\nAND MKT.JADWAL = ''Rabu''', 1, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(390, 34, 19, 0, 'select DISTINCT D.NAMA\r\nfrom DOSEN D,  MK_TAWAR M,  MATAKULIAH MK\r\nwhere D.NIP = M.NIP\r\nand M.ID_MK = MK.ID_MK\r\nand M.JADWAL = ''Rabu''\r\nand MK.ID_MK = ''IF1409'';', 1, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(391, 35, 19, 0, 'SELECT distinct MAHASISWA.NAMA \r\n	FROM DOSEN, MK_TAWAR, FRS, MAHASISWA \r\n	WHERE 	DOSEN.NIP = MK_TAWAR.NIP AND \r\n		MK_TAWAR.ID_MK_TAWAR = FRS.ID_MK_TAWAR AND \r\n		FRS.NRP = MAHASISWA.NRP AND \r\n		DOSEN.NAMA LIKE ''%Rully%''\r\n	ORDER BY MAHASISWA.NAMA;\r\n', 1, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(392, 36, 19, 100, 'SELECT DISTINCT DOSEN.NAMA\r\nFROM DOSEN, MK_TAWAR, FRS\r\nWHERE DOSEN.NIP = MK_TAWAR.NIP AND FRS.ID_MK_TAWAR = MK_TAWAR.ID_MK_TAWAR AND FRS.NILAI_HURUF = ''B''\r\nORDER BY DOSEN.NAMA ASC', 1, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(393, 37, 19, 0, 'SELECT NAMA FROM MAHASISWA, ( 	SELECT SEMESTER, TAHUN, FRS.NRP, SUM(MATAKULIAH.SKS)  	FROM FRS, MK_TAWAR, MATAKULIAH  	WHERE FRS.ID_MK_TAWAR = MK_TAWAR.ID_MK_TAWAR AND MK_TAWAR.ID_MK =   MATAKULIAH.ID_MK  	GROUP BY SEMESTER, TAHUN, FRS.NRP 	HAVING SUM(MATAKULIAH.SKS) > 18 ) X WHERE X.SEMESTER = 2 AND X.TAHUN = 2001 AND MAHASISWA.NRP = X.NRP ORDER BY NAMA ASC;', 1, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(394, 35, 49, 0, 'SELECT M.NAMA\r\nFROM MAHASISWA M, FRS F\r\nWHERE F.ID_MK_TAWAR IN\r\n	(SELECT MKT.ID_MK_TAWAR\r\n	FROM MK_TAWAR MKT\r\n	WHERE MKT.NIP =\r\n		(SELECT NIP\r\n		FROM DOSEN\r\n		WHERE NAMA = ''Rully Soelaiman''))\r\nAND F.NRP = M.NRP', 1, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(395, 35, 49, 0, 'SELECT DISTINCT M.NAMA\r\nFROM MAHASISWA M, FRS F\r\nWHERE F.ID_MK_TAWAR IN\r\n	(SELECT MKT.ID_MK_TAWAR\r\n	FROM MK_TAWAR MKT\r\n	WHERE MKT.NIP =\r\n		(SELECT NIP\r\n		FROM DOSEN\r\n		WHERE NAMA = ''Rully Soelaiman''))\r\nAND F.NRP = M.NRP', 1, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(396, 35, 49, 0, 'SELECT DISTINCT M.NAMA\r\nFROM MAHASISWA M, FRS F\r\nWHERE F.ID_MK_TAWAR IN\r\n	(SELECT MKT.ID_MK_TAWAR\r\n	FROM MK_TAWAR MKT\r\n	WHERE MKT.NIP =\r\n		(SELECT NIP\r\n		FROM DOSEN\r\n		WHERE NAMA = ''Rully Soelaiman''))\r\nAND F.NRP = M.NRP ORDER BY M.NAMA', 1, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
