(412, 52, 19, 100, 'select mk_tawar.tahun, mk_tawar.semester, count(frs.nrp) as jumlah_siswa, count(mk_tawar.kelas) as jumlahkelas \r\nfrom mk_tawar, frs, matakuliah \r\nwhere mk_tawar.id_mk_tawar = frs.id_mk_tawar and mk_tawar.id_mk = matakuliah.id_mk and matakuliah.nilai_min < ''D'' and MOD(mk_tawar.tahun,2) = 1\r\ngroup by mk_tawar.tahun, mk_tawar.semester\r\norder by mk_tawar.TAHUN;', 1, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(413, 52, 19, 100, 'select mk_tawar.tahun, mk_tawar.semester, count(frs.nrp) as jumlah_siswa, count(mk_tawar.kelas) as jumlahkelas \r\nfrom mk_tawar, frs, matakuliah \r\nwhere mk_tawar.id_mk_tawar = frs.id_mk_tawar and mk_tawar.id_mk = matakuliah.id_mk and matakuliah.nilai_min < ''D'' and MOD(mk_tawar.tahun,2) = 1\r\ngroup by mk_tawar.tahun, mk_tawar.semester\r\norder by mk_tawar.TAHUN;', 1, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(414, 53, 19, 0, 'select f.nrp , m.nama\r\nfrom frs f, mahasiswa m, mk_tawar t, matakuliah k\r\nwhere f.nrp = m.nrp and f.id_mk_tawar = t.id_mk_tawar\r\n	and t.id_mk = k.id_mk and substr(f.nrp,3, 2) =01\r\n	and f.id_mk_tawar IN\r\n		(select t.id_mk_tawar\r\n		 from mk_tawar t, matakuliah m\r\n		 where t.id_mk = m.id_mk and m.mata_kuliah = ‘BASIS DATA’)\r\n	and f.id_mk_tawar NOT IN\r\n		(select t.id_mk_tawar\r\n		 from mk_tawar t, matakuliah m\r\n		 where t.id_mk = m.id_mk and m.mata_kuliah = ‘BASIS DATA TERDISTRIBUSI’);\r\n', 1, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(415, 53, 19, 100, 'select f.nrp , m.nama\r\nfrom frs f, mahasiswa m, mk_tawar t, matakuliah k\r\nwhere f.nrp = m.nrp and f.id_mk_tawar = t.id_mk_tawar\r\n	and t.id_mk = k.id_mk and substr(f.nrp,3, 2) =01\r\n	and f.id_mk_tawar IN\r\n		(select t.id_mk_tawar\r\n		 from mk_tawar t, matakuliah m\r\n		 where t.id_mk = m.id_mk and m.mata_kuliah = ''BASIS DATA'')\r\n	and f.id_mk_tawar NOT IN\r\n		(select t.id_mk_tawar\r\n		 from mk_tawar t, matakuliah m\r\n		 where t.id_mk = m.id_mk and m.mata_kuliah = ''BASIS DATA TERDISTRIBUSI'');', 1, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(416, 54, 19, 0, 'select f.nrp\r\nfrom frs f, mahasiswa m, mk_tawar t, matakuliah k\r\nwhere f.nrp = m.nrp and f.id_mk_tawar = t.id_mk_tawar\r\n	and t.id_mk = k.id_mk and TO_NUMBER(substr(f.nrp,3, 2),''99'') > 94 and TO_NUMBER(substr(f.nrp,3, 2),''99'') < 99\r\n	and ( f.id_mk_tawar IN\r\n		(select t.id_mk_tawar\r\n		 from mk_tawar t, matakuliah m\r\n		 where t.id_mk = m.id_mk and m.mata_kuliah = ''BASIS DATA'')\r\n	or f.id_mk_tawar IN\r\n		(select t.id_mk_tawar\r\n		 from mk_tawar t, matakuliah m\r\n		 where t.id_mk = m.id_mk and m.mata_kuliah = ''BASIS DATA TERDISTRIBUSI''))\r\ngroup by f.NRP', 1, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(417, 55, 19, 100, 'select NAMA, TGL_LHR\r\nfrom MAHASISWA\r\nwhere NRP in (select NRP \r\n              from FRS\r\n              where ID_MK_TAWAR not in (select ID_MK \r\n                                  from MK_TAWAR \r\n                                  where NIP not in (select NIP \r\n                                                    from MK_TAWAR\r\n                                                    where KELAS = ''A'')\r\n                                  and NIP in (select NIP \r\n                                              from MK_TAWAR\r\n                                              where DAYA_TAMPUNG > (select avg(DAYA_TAMPUNG) \r\n                                                                    from MK_TAWAR \r\n                                                                    where SEMESTER = 2))))\r\nand EXTRACT(YEAR from TGL_LHR) < 1985\r\norder by NAMA;', 1, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(418, 56, 19, 100, 'select mk_tawar.tahun, mk_tawar.semester, count(frs.nrp) as jumlah_siswa, count(mk_tawar.kelas) as jumlahkelas \r\nfrom mk_tawar, frs, matakuliah \r\nwhere mk_tawar.id_mk_tawar = frs.id_mk_tawar and mk_tawar.id_mk = matakuliah.id_mk and matakuliah.mata_kuliah LIKE ''JARINGAN%'' \r\ngroup by mk_tawar.tahun, mk_tawar.semester\r\norder by mk_tawar.tahun;', 1, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(438, 64, 58, 100, 'select mk_tawar.tahun, mk_tawar.semester, count(frs.nrp) as jumlah_siswa, count(mk_tawar.kelas) as jumlahkelas \r\nfrom mk_tawar, frs, matakuliah \r\nwhere mk_tawar.id_mk_tawar = frs.id_mk_tawar and mk_tawar.id_mk = matakuliah.id_mk and matakuliah.mata_kuliah LIKE ''JARINGAN%'' \r\ngroup by mk_tawar.tahun, mk_tawar.semester\r\norder by mk_tawar.tahun;', 1, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(439, 65, 58, 100, 'select mk_tawar.tahun, mk_tawar.semester, count(frs.nrp) as jumlah_siswa, count(mk_tawar.kelas) as jumlahkelas \r\nfrom mk_tawar, frs, matakuliah \r\nwhere mk_tawar.id_mk_tawar = frs.id_mk_tawar and mk_tawar.id_mk = matakuliah.id_mk and matakuliah.nilai_min < ''D'' and MOD(mk_tawar.tahun,2) = 1\r\ngroup by mk_tawar.tahun, mk_tawar.semester\r\norder by mk_tawar.TAHUN;', 1, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
