(551, 60, 18, 100, '\r\nselect m.*\r\nfrom mahasiswa m, dosen d, frs f, mk_tawar mk, matakuliah mt\r\nwhere m.nrp= f.nrp and f.id_mk_tawar=mk.id_mk_tawar and mk.nip= d.nip and d.nama=''Sarwosri, S.Kom'' and mk.id_mk= mt.id_mk and mt.mata_kuliah=''ARSITEKTUR KOMPUTER''\r\norder by m.nrp asc\r\n', 1, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(552, 63, 39, 100, 'SELECT DISTINCT M.ID_MK,M.MATA_KULIAH,M.SKS,M.NILAI_MIN,F.NILAI_HURUF\r\nFROM MATAKULIAH M, FRS F, NILAI N, MK_TAWAR O\r\nWHERE N.NILAI_HURUF = F.NILAI_HURUF AND\r\n      N.NILAI_ANGKA > (SELECT AVG(NILAI_ANGKA) FROM NILAI) AND\r\n      O.ID_MK_TAWAR = F.ID_MK_TAWAR AND\r\n      M.ID_MK = O.ID_MK\r\nORDER BY M.ID_MK, NILAI_HURUF DESC;', 1, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
