(710, 58, 31, 0, 'select NRP, NAMA, TEMPAT_LAHIR\r\nFROM MAHASISWA, FRS\r\nwhere nilai_huruf=''E'';', 1, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(711, 63, 43, 100, 'select distinct ma.*, f.nilai_huruf\r\nfrom frs f, nilai n, mk_tawar mk, matakuliah ma\r\nwhere f.nilai_huruf = n.nilai_huruf and n.nilai_angka > (select avg(nilai_angka) from nilai)\r\nand mk.id_mk = ma.id_mk and f.id_mk_tawar = mk.id_mk_tawar\r\norder by ma.id_mk, f.nilai_huruf desc;', 1, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(712, 58, 19, 0, 'SELECT m.NRP,m.nama, m.tgl_lhr\r\nFROM MAHASISWA M,frs f\r\nWHERE m.nrp in (\r\nselect f.nrp\r\nfrom frs f\r\nwhere f.nilai_huruf = ''E'');', 1, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(713, 58, 56, 0, 'SELECT DISTINCT MAHASISWA.NAMA,MAHASISWA.NRP,MAHASISWA.TEMPAT_LHR\r\nfrom MAHASISWA,FRS\r\nwhere MAHASISWA.NRP=FRS.NRP and FRS_NILAI_HURUF=''E''\r\norder by NRP DESC;', 1, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(714, 58, 56, 100, 'SELECT DISTINCT MAHASISWA.NAMA,MAHASISWA.NRP,MAHASISWA.TEMPAT_LHR\nFROM MAHASISWA,FRS\nwhere MAHASISWA.NRP=FRS.NRP and FRS.NILAI_HURUF=''E''\norder by NRP DESC;', 1, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(715, 58, 31, 0, 'select P.NRP,P.NAMA,P.TEMPAT_LHR\r\nFROM MAHASISWA P, FRS F\r\nwhere nilai_huruf=''E'' AND f.nrp= p.nrp \r\nORDER BY p.nrp DESC;', 1, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(716, 60, 47, 100, 'select m.*\r\nfrom\r\n  (select f.NRP\r\n  from\r\n    (select distinct a.id_mk_tawar\r\n    from\r\n      (select nip,id_mk_tawar\r\n        from\r\n        (select ID_MK\r\n          from matakuliah m\r\n          where m.mata_kuliah like ''ARSITEKTUR KOMPUTER'') a, mk_tawar m\r\n      where a.id_mk = m.id_mk) a,dosen d\r\n    where a.nip=d.nip and d.nama like ''Sarwosri, S.Kom'') a,frs f\r\n  where f.id_mk_tawar=a.id_mk_tawar) a, mahasiswa m\r\nwhere a.NRP=m.NRP\r\norder by m.nrp asc;', 1, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(717, 70, 89, 100, 'select d.*\r\nfrom dosen d, mk_tawar mk, frs f\r\nwhere d.nip = mk.nip and mk.id_mk_tawar= f.id_mk_tawar and f.nrp in(select nrp from mahasiswa where mahasiswa.nama like ''____u%'')\r\norder by d.nip asc\r\n;', 1, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(718, 74, 89, 100, 'select f.nrp as nrp,sum(n.nilai_angka*m.sks)/sum(m.sks) as ips\r\nfrom nilai n, frs f, mk_tawar mk, matakuliah m\r\nwhere mk.id_mk_tawar = f.id_mk_tawar and f.nilai_huruf= n.nilai_huruf and mk.id_mk=m.id_mk and mk.semester=''2'' and mk.tahun=''2001''\r\ngroup by f.nrp\r\nhaving sum(n.nilai_angka*m.sks)/sum(m.sks) > (select avg(s.ips) from ( select sum(n.nilai_angka*m.sks)/sum(m.sks) as ips from nilai n, frs f, mk_tawar mk, matakuliah m where mk.id_mk_tawar = f.id_mk_tawar and f.nilai_huruf= n.nilai_huruf and mk.id_mk=m.id_mk and mk.semester=''2'' and mk.tahun=''2001'' group by f.nrp) s)\r\norder by ips asc;', 1, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(719, 58, 24, 100, 'select distinct nrp, nama, tempat_lhr\r\nfrom mahasiswa\r\nwhere mahasiswa.nrp in\r\n  (select frs.nrp\r\nfrom frs\r\nwhere nilai_huruf = ''E'') order by (nrp) desc;', 1, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
