(1050, 72, 100, 100, 'select * from dosen where nip in\r\n(select nip from mk_tawar where id_mk_tawar in\r\n(select id_mk_tawar from frs where id_mk_tawar in\r\n(select id_mk_tawar from mk_tawar where id_mk = ''IF1409'') and nilai_huruf = ''B'')) order by nip asc;', 1, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(1051, 73, 100, 0, 'select * from matakuliah where id_mk in\r\n(select id_mk from mk_tawar where id_mk_tawar in\r\n(select id_mk_tawar from frs where nrp in\r\n(select nrp from mahasiswa where to_char (tgl_lhr, ''mm'') = ''09''))) order by id_mk asc;', 1, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(1052, 72, 110, 100, 'SELECT *\r\nFROM DOSEN\r\nWHERE NIP IN\r\n(\r\nSELECT D.NIP\r\nFROM MAHASISWA M,FRS F, MK_TAWAR MT, MATAKULIAH MK, DOSEN D\r\nWHERE M.NRP=F.NRP AND F.ID_MK_TAWAR=MT.ID_MK_TAWAR AND MT.ID_MK=MK.ID_MK AND F.nilai_huruf=''B'' AND D.NIP=MT.NIP AND MK.ID_MK=''IF1409''\r\n)\r\nORDER BY NIP ASC', 1, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
