(1054, 47, 70, 0, 'SELECT MAHASISWA.NAMA, NILAI_HURUF\r\nFROM MAHASISWA, (\r\n                  SELECT FRS.NRP, NILAI_HURUF\r\n                  FROM FRS\r\n                  WHERE ID_MK_TAWAR=\r\n                    (\r\n                    SELECT ID_MK_TAWAR\r\n                    FROM MK_TAWAR\r\n                    WHERE ID_MK_TAWAR=''IF1417'' AND TAHUN=''2002'' AND KELAS=''E''))\r\nWHERE AGAMA=''HINDU''\r\nORDER BY MAHASISWA.NAMA;', 1, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(1055, 70, 95, 0, 'select *\r\nfrom dosen\r\nwhere nip in (select nip\r\n              from mk_tawar\r\n              where id_mk_tawar in (select id_mk_tawar\r\n                                    from frs\r\n                                    where nrp in (select nrp\r\n                                                  from mahasiswa\r\n                                                  where nama like ''___u%'' or nama like ''___U%'')))\r\norder by nip asc;', 1, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(1056, 47, 65, 0, 'SELECT m.NAMA,count(f.NILAI_HURUF)\r\nFROM MAHASISWA m,FRS f\r\nWHERE  (m.NAMA LIKE ''%atma%'' OR m.NAMA LIKE ''Atma%'' OR m.NAMA LIKE ''%atma'') AND f.NRP=m.NRP AND f.NILAI_HURUF=''A''  \r\nGROUP BY m.NAMA\r\nORDER BY m.NAMA;', 1, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(1057, 70, 103, 0, 'select dosen.*\r\nfrom dosen, mahasiswa, frs, mk_tawar\r\nwhere mk_tawar.nip= dosen.nip\r\nand frs.nrp= mahasiswa.nrp\r\nand  frs.id_mk_tawar= mk_tawar.id_mk_tawar\r\nand mahasiswa.nama like ''___U%''\r\norder by dosen.nip asc;', 1, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(1058, 48, 75, 0, 'select mahasiswa.nama ,frs.nilai_huruf from mahasiswa,frs where mahasiswa.nrp=frs.nrp and id_mk_tawar in (Select mk_tawar.id_mk_tawar from mk_tawar,matakuliah where matakuliah.id_mk=mk_tawar.id_mk and matakuliah.mata_kuliah = ''PRAKTIKUM SISTEM DIGITAL''and mk_tawar.tahun=''2002''and kelas=''E'')\r\nand (mahasiswa.agama=''4'' or mahasiswa.agama=''5'');', 1, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(1059, 48, 82, 0, 'select m.nama,f.nilai_huruf\r\nfrom mahasiswa m, frs f\r\nwhere m.NRP=f.NRP AND f.id_mk_tawar=(\r\n                                      select id_mk_tawar from mk_tawar where id_mk=\r\n                                      (\r\n                                        select id_mk from matakuliah where mata_kuliah=''Praktikum Sistem Digital''\r\n                                      ) AND tahun=''2002'' AND kelas=''E''\r\n                                    ) AND m.agama=''4'' OR m.agama=''5''\r\norder by m.nama;', 1, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(1060, 71, 111, 0, 'select DISTINCT m.nama, mk.mata_kuliah, f.nilai_huruf, mk.nilai_min\r\nfrom mahasiswa m, matakuliah mk, frs f, mk_tawar t\r\nwhere m.nrp= f.nrp and f.id_mk_tawar= t.id_mk_tawar and t.id_mk= mk.id_mk and t.semester=1 and f.nilai_huruf> mk.nilai_min\r\norder by m.nama asc;', 1, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(1061, 47, 65, 0, 'SELECT m.NAMA,count(f.NILAI_HURUF)\r\nFROM MAHASISWA m,FRS f\r\nWHERE  (m.NAMA LIKE ''%atma%'' OR m.NAMA LIKE ''Atma%'' OR m.NAMA LIKE ''%atma'') AND f.NRP=m.NRP AND f.NILAI_HURUF=''A''  \r\nGROUP BY m.NAMA\r\nORDER BY m.NAMA', 1, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(1062, 72, 111, 100, 'select distinct d.*\r\nfrom dosen d, mahasiswa m, mk_tawar t, frs f\r\nwhere t.id_mk=''IF1409'' and t.id_mk_tawar= f.id_mk_tawar and m.nrp= f.nrp and f.nilai_huruf=''B'' and t.nip= d.nip\r\norder by d.nip asc;', 1, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(1063, 70, 102, 100, 'SELECT d.*\r\nFROM dosen d, mahasiswa m, mk_tawar mt, frs f\r\nWHERE d.nip = mt.nip and mt.id_mk_tawar = f.id_mk_tawar and f.nrp = m.nrp and m.nama like ''___u%''\r\nORDER BY d.nip asc;', 1, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
