INSERT INTO `submission` (`id`, `question_id`, `users_id`, `nilai`, `jawaban`, `status`, `deleted_at`, `created_at`, `updated_at`) VALUES
(1080, 70, 119, 100, 'select d.*\r\nfrom dosen d, mahasiswa m, frs f, mk_tawar mkt\r\nwhere\r\nd.nip = mkt.nip and\r\nm.nama like ''___u%'' and\r\nm.nrp = f.nrp and\r\nf.id_mk_tawar = mkt.id_mk_tawar\r\norder by d.nip asc;', 1, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(1081, 70, 94, 100, 'select d.*\r\nfrom dosen d, mahasiswa m, frs f, mk_tawar mk\r\nwhere m.NAMA like ''___u%'' and m.nrp=f.nrp and f.id_mk_tawar=mk.id_mk_tawar and mk.nip=d.nip\r\nORDER BY D.NIP ASC;\r\n', 1, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(1082, 47, 65, 0, 'SELECT m.NAMA,count(f.NILAI_HURUF)\r\nFROM MAHASISWA m,FRS f\r\nWHERE  (m.NAMA=''%atma%'' OR m.NAMA=''atma%'' OR m.NAMA=''%atma'') AND f.NRP=m.NRP AND f.NILAI_HURUF=''A''  \r\nGROUP BY m.NAMA\r\nORDER BY m.NAMA;\r\n', 1, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(1083, 72, 99, 0, 'select d.*\r\nfrom dosen d, mk_tawar mt, frs f, matakuliah mk, mahasiswa m\r\nwhere f.nilai_huruf like ''B'' and mk.id_mk like ''IF1409'' and f.id_mk_tawar= mt.id_mk_tawar and mt.nip= d.nip and m.nrp= f.nrp\r\norder by d.nip asc;', 1, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(1084, 71, 110, 0, 'SELECT M.NAMA,F.NILAI_HURUF,MK.MATA_KULIAH,MK.NILAI_MIN\r\nFROM MAHASISWA M,FRS F, MK_TAWAR MT, DOSEN D,MATAKULIAH MK\r\nWHERE M.NRP=F.NRP AND F.ID_MK_TAWAR=MT.ID_MK_TAWAR AND D.NIP=MT.NIP AND MK.ID_MK=MT.ID_MK AND MT.ID_MK_TAWAR IN \r\n(\r\n  SELECT ID_MK_TAWAR\r\n  FROM MK_TAWAR\r\n  WHERE SEMESTER=1\r\n)\r\nORDER BY M.NAMA ASC', 1, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(1085, 72, 98, 100, 'select DISTINCT d.*\r\nfrom mahasiswa m, matakuliah mh, frs f, mk_tawar mk, dosen d\r\nwhere m.nrp = f.nrp and f.id_mk_tawar = mk.id_mk_tawar and mk.id_mk = mh.id_mk \r\nand mh.id_mk = ''IF1409'' and d.nip = mk.nip\r\norder by d.nip asc', 1, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(1086, 74, 119, 0, 'select distinct mhs.*\r\nfrom (select m.nrp, sum(n.nilai_angka* mk.sks)/sum(mk.sks) "IPS"\r\n  from mahasiswa m, frs f, nilai n, matakuliah mk, mk_tawar mkt\r\n  where\r\n  m.nrp = f.nrp and\r\n  f.nilai_huruf = n.nilai_huruf and\r\n  f.id_mk_tawar = mkt.id_mk_tawar and\r\n  mkt.id_mk = mk.id_mk\r\n  group by m.nrp) j, mahasiswa mhs, frs f, mk_tawar mt\r\nwhere\r\n  j."IPS" > (select AVG(sum(n.nilai_angka* mk.sks)/sum(mk.sks))\r\n    from mahasiswa m, frs f, nilai n, matakuliah mk, mk_tawar mkt\r\n    where\r\n    m.nrp = f.nrp and\r\n    f.nilai_huruf = n.nilai_huruf and\r\n    f.id_mk_tawar = mkt.id_mk_tawar and\r\n    mkt.id_mk = mk.id_mk\r\n    group by m.nrp) and\r\n  j.nrp = mhs.nrp and\r\n  mhs.nrp = f.nrp and\r\n  f.id_mk_tawar = mt.id_mk_tawar and\r\n  mt.tahun = ''2001'' and\r\n  mt.semester = 2;', 1, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(1087, 72, 91, 100, 'select distinct dsn.*\r\nfrom dosen dsn, mahasiswa mhs, frs f, matakuliah mk, mk_tawar mkt\r\nwhere  dsn.nip= mkt.nip and mkt.id_mk_tawar= f.id_mk_tawar and f.nrp=mhs.nrp and mk.id_mk=mkt.id_mk and mk.id_mk=''IF1409'' and f.nilai_huruf=''B''\r\norder by dsn.nip asc', 1, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(1088, 72, 110, 0, 'SELECT M.NAMA,F.NILAI_HURUF,MK.MATA_KULIAH,MK.NILAI_MIN\r\nFROM MAHASISWA M,FRS F, MK_TAWAR MT, DOSEN D,MATAKULIAH MK\r\nWHERE M.NRP=F.NRP AND F.ID_MK_TAWAR=MT.ID_MK_TAWAR AND D.NIP=MT.NIP AND MK.ID_MK=MT.ID_MK AND MT.ID_MK_TAWAR IN \r\n(\r\n  SELECT ID_MK_TAWAR\r\n  FROM MK_TAWAR\r\n  WHERE SEMESTER=1\r\n)\r\nORDER BY M.NAMA ASC', 1, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(1089, 71, 94, 0, 'select m.nama, n.nilai_huruf, n.nilai_angka, mt.mata_kuliah, mt.nilai_min\r\nfrom mahasiswa m, nilai n, matakuliah mt, mk_tawar mk\r\nwhere mk.semester = 1 and mk.ID_MK = MT.id_mk \r\nORDER BY M.NAMA ASC;\r\n', 1, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
