(1091, 72, 119, 100, 'select distinct d.*\r\nfrom dosen d, frs f, mahasiswa m, mk_tawar mkt\r\nwhere\r\nmkt.id_mk = ''IF1409'' and\r\nf.nilai_huruf = ''B'' and\r\nm.nrp = f.nrp and\r\nf.id_mk_tawar = mkt.id_mk_tawar and\r\nd.nip = mkt.nip\r\norder by d.nip asc;', 1, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(1092, 72, 94, 0, 'select  d.*\r\nfrom dosen d, mk_tawar mk, frs f, mahasiswa m\r\nwhere f.nilai_huruf like ''B'' and mk.ID_MK like ''IF1409'' and f.id_mk_tawar=mk.id_mk_tawar and\r\nmk.nip=d.nip and m.nrp=f.nrp\r\nORDER BY d.NIP ASC; \r\n', 1, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
