(1094, 74, 94, 0, 'select distinct mhs.*\r\nfrom (select m.nrp, sum(n.nilai_angka* mk.sks)/sum(mk.sks) "IPS"\r\n  from mahasiswa m, frs f, nilai n, matakuliah mk, mk_tawar mkt\r\n  where\r\n  m.nrp = f.nrp and\r\n  f.nilai_huruf = n.nilai_huruf and\r\n  f.id_mk_tawar = mkt.id_mk_tawar and\r\n  mkt.id_mk = mk.id_mk\r\n  group by m.nrp) j, mahasiswa mhs, frs f, mk_tawar mt\r\nwhere\r\n  j."IPS" > (select AVG(sum(n.nilai_angka* mk.sks)/sum(mk.sks))\r\n    from mahasiswa m, frs f, nilai n, matakuliah mk, mk_tawar mkt\r\n    where\r\n    m.nrp = f.nrp and\r\n    f.nilai_huruf = n.nilai_huruf and\r\n    f.id_mk_tawar = mkt.id_mk_tawar and\r\n    mkt.id_mk = mk.id_mk\r\n    group by m.nrp) and\r\n  j.nrp = mhs.nrp and\r\n  mhs.nrp = f.nrp and\r\n  f.id_mk_tawar = mt.id_mk_tawar and\r\n  mt.tahun = ''2001'' and\r\n  mt.semester = 2;', 1, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
