(1096, 70, 102, 0, 'SELECT d.*\r\nFROM dosen d, mahasiswa m, matakuliah mk, mk_tawar mt, frs f\r\nWHERE m.nrp = f.nrp and f.id_mk_tawar = mt.id_mk_tawar and mt.id_mk = mk.id_mk and mt.nip = d.nip and f.nrp = m.nrp and mk.id_mk like ''IF1409'' and f.nilai_huruf like ''B''\r\nORDER BY d.nip asc;', 1, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
