(1136, 70, 100, 0, 'select * from dosen where nip in\r\n(select nip from mk_tawar where id_mk_tawar in\r\n(select id_mk_tawar from frs where nrp in\r\n(select nrp from mahasiswa where nama like ''___u%''))) order by nip asc;', 1, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(1137, 48, 75, 100, 'select mahasiswa.nama ,frs.nilai_huruf from mahasiswa,frs where mahasiswa.nrp=frs.nrp and id_mk_tawar in (select mk_tawar.id_mk_tawar from mk_tawar,matakuliah where matakuliah.id_mk=mk_tawar.id_mk and matakuliah.mata_kuliah = ''PRAKTIKUM SISTEM DIGITAL'' and mk_tawar.tahun=''2002''and mk_tawar.kelas=''E'')\r\nand (mahasiswa.agama=''4'' or mahasiswa.agama=''5'')order by mahasiswa.nama ASC;', 1, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(1138, 48, 79, 100, 'select M.NAMA, F.NILAI_HURUF\r\nfrom MAHASISWA M, FRS F, MK_TAWAR MT\r\nwhere MT.ID_MK_TAWAR IN\r\n(select ID_MK_TAWAR \r\nfrom MK_TAWAR\r\nwhere MT.ID_MK = ''IF1417''\r\nand MT.TAHUN = ''2002''\r\nand MT.KELAS = ''E''\r\n)\r\nand MT.ID_MK_TAWAR = F.ID_MK_TAWAR\r\nand F.NRP = M.NRP\r\nand M.NAMA IN (\r\nselect NAMA\r\nfrom MAHASISWA\r\nwhere AGAMA = ''5''\r\nor AGAMA = ''4''\r\n)\r\norder by M.NAMA;', 1, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(1139, 72, 100, 100, 'select * from dosen where nip in\r\n(select nip from mk_tawar where id_mk_tawar in\r\n(select id_mk_tawar from frs where id_mk_tawar in\r\n(select id_mk_tawar from mk_tawar where id_mk = ''IF1409'') and nilai_huruf = ''B'')) order by nip asc;', 1, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(1140, 48, 82, 0, 'select DISTINCT m.nama,f.nilai_huruf\r\nfrom mahasiswa m, frs f\r\nwhere m.NRP=f.NRP AND f.id_mk_tawar=(\r\n                                      select distinct id_mk_tawar from mk_tawar where id_mk=\r\n                                      (\r\n                                        select distinct\r\n                                        id_mk from matakuliah where mata_kuliah=''Praktikum Sistem Digital''\r\n                                      ) AND tahun=''2002'' AND kelas=''E''\r\n                                    ) AND m.agama=''4'' OR m.agama=''5''\r\norder by m.nama;', 1, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(1141, 72, 99, 100, 'select distinct d.*\r\nfrom dosen d, frs f, mahasiswa m, mk_tawar mt\r\nwhere mt.id_mk = ''IF1409'' and f.nilai_huruf = ''B'' and m.nrp = f.nrp and f.id_mk_tawar = mt.id_mk_tawar and d.nip = mt.nip\r\norder by d.nip asc;', 1, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(1142, 73, 100, 0, 'select * from matakuliah where id_mk in\r\n(select id_mk from mk_tawar where id_mk_tawar in\r\n(select id_mk_tawar from frs where nrp in\r\n(select nrp from mahasiswa where to_char (tgl_lhr, ''mm'') = ''09''))) order by id_mk asc;', 1, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(1143, 48, 66, 100, 'select distinct m.nama, frs.nilai_huruf\r\nfrom (select nrp, nama from mahasiswa where agama=''4'' or agama=''5'' order by nama) m, frs\r\nwhere frs.id_mk_tawar in (select id_mk_tawar from mk_tawar where tahun=''2002'' and kelas=''E'' and id_mk=(\r\nselect id_mk from matakuliah where mata_kuliah=''PRAKTIKUM SISTEM DIGITAL'')) and frs.nrp=m.nrp\r\norder by m.nama\r\n', 1, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(1144, 47, 74, 0, 'select nama, count(nilai_huruf) from mahasiswa,frs where mahasiswa.nrp = frs.nrp\r\nand (nama like ''%ATMA%'' or nama like ''ATMA%'' or nama like ''%ATMA'') \r\nand nilai_huruf = ''A'' group by nama\r\n', 1, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(1145, 70, 94, 100, 'select d.*\r\nfrom dosen d, mahasiswa m, frs f, mk_tawar mk\r\nwhere m.nama like ''___u%''  and m.nrp=f.nrp and f.id_mk_tawar=mk.id_mk_tawar and \r\nmk.nip=d.nip\r\nORDER BY D.NIP ASC;', 1, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(1146, 47, 65, 0, 'SELECT m.NAMA,count(f.NILAI_HURUF)\r\nFROM MAHASISWA m,FRS f\r\nWHERE  (m.NAMA LIKE ''%ATMA%'' OR m.NAMA LIKE ''ATMA%'' OR m.NAMA LIKE ''%ATMA'') AND f.NRP=m.NRP AND f.NILAI_HURUF=''A''\r\nGROUP BY m.NAMA\r\nORDER BY m.NAMA;', 1, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(1147, 70, 101, 100, 'select d.*\r\nfrom dosen d, mahasiswa m, frs s, mk_tawar mt\r\nwhere m.nama like ''___u%''and m.nrp=s.nrp and mt.id_mk_tawar= s.id_mk_tawar and d.nip=mt.nip\r\norder by d.nip asc;', 1, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(1148, 47, 74, 0, 'select nama, count(nilai_huruf) as JML_NILAI_A from mahasiswa,frs where mahasiswa.nrp = frs.nrp\r\nand (nama like ''%ATMA%'' or nama like ''ATMA%'' or nama like ''%ATMA'') \r\nand nilai_huruf = ''A'' group by nama order by nama asc', 1, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(1149, 73, 102, 0, 'SELECT mk.*\r\nFROM matakuliah mk, frs f, mahasiswa m, mk_tawar mkt\r\nWHERE mk.id_mk = mkt.id_mk and f.id_mk_tawar = mkt.id_mk_tawar and f.nrp = m.nrp and to_char(m.tgl_lhr, ''MM'') = 9\r\nORDER BY mkt.id_mk_tawar asc;', 1, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(1150, 48, 66, 100, 'select distinct m.nama, frs.nilai_huruf\r\nfrom (select nrp, nama from mahasiswa where agama=''4'' or agama=''5'') m, frs\r\nwhere frs.id_mk_tawar in (select id_mk_tawar from mk_tawar where tahun=''2002'' and kelas=''E'' and id_mk in (\r\nselect id_mk from matakuliah where mata_kuliah=''PRAKTIKUM SISTEM DIGITAL'')) and frs.nrp=m.nrp\r\norder by m.nama\r\n', 1, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(1151, 48, 85, 0, 'select m.nama, f.nilai_huruf\r\nfrom mahasiswa m, frs f\r\nwhere f.nilai_huruf in\r\n  (select f.nilai_huruf\r\n  from frs f\r\n  where f.id_mk_tawar =\r\n   (select m.id_mk_tawar\r\n   from mk_tawar m\r\n   where m.id_mk =\r\n    (select mk.id_mk\r\n    from matakuliah mk\r\n    where mata_kuliah = ''praktikum sistem digital'')\r\n  and m.tahun = ''2002''\r\n  and m.kelas = ''E''))\r\nand m.agama = ''4''\r\nor m.agama = ''5'';', 1, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(1152, 49, 77, 0, 'SELECT MK_TAWAR.ID_MK_TAWAR, MATAKULIAH.MATA_KULIAH, MK_TAWAR.TAHUN\r\nFROM MK_TAWAR, MATAKULIAH\r\n  WHERE MK_TAWAR.DAYA_TAMPUNG < (SELECT AVG(MK_TAWAR.DAYA_TAMPUNG) FROM mk_tawar)', 1, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(1153, 47, 86, 0, 'SELECT NAMA, COUNT(NILAI_HURUF)\r\nFROM (\r\n    SELECT *\r\n    FROM MAHASISWA\r\n    RIGHT JOIN (\r\n      SELECT * FROM FRS\r\n      WHERE NRP IN (\r\n      SELECT NRP\r\n      FROM MAHASISWA\r\n      WHERE NAMA LIKE ''%ATMA%'' OR NAMA LIKE ''%ATMA'' OR NAMA LIKE ''ATMA%'')\r\n    ) HASIL\r\n    ON MAHASISWA.NRP = HASIL.NRP\r\n  ) H\r\nWHERE NILAI_HURUF=''A''\r\nGROUP BY NAMA;', 1, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(1154, 47, 79, 0, 'select M.NAMA, count(F.NILAI_HURUF) as JUMLAH\r\nfrom MAHASISWA M, FRS F\r\nwhere F.NILAI_HURUF = ''A''\r\nand M.NAMA IN \r\n(\r\nselect M.NAMA\r\nfrom MAHASISWA M\r\nwhere M.NAMA LIKE ''ATMA%''\r\nor M.NAMA LIKE ''%ATMA''\r\nor M.NAMA LIKE ''%ATMA%''\r\n)\r\nand M.NRP = F.NRP\r\ngroup by M.NAMA;', 1, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(1155, 48, 83, 100, 'select MAHASISWA.NAMA, FRS.NILAI_HURUF\r\nfrom MAHASISWA, FRS, MATAKULIAH, MK_TAWAR\r\nwhere MAHASISWA.AGAMA=5 and MK_TAWAR.TAHUN = ''2002'' and MK_TAWAR.KELAS = ''E'' and MATAKULIAH.MATA_KULIAH = ''PRAKTIKUM SISTEM DIGITAL'' and MAHASISWA.NRP=FRS.NRP and FRS.ID_MK_TAWAR=MK_TAWAR.ID_MK_TAWAR and MATAKULIAH.ID_MK=MK_TAWAR.ID_MK\r\nor MAHASISWA.AGAMA=4 and MK_TAWAR.TAHUN = ''2002'' and MK_TAWAR.KELAS = ''E'' and MATAKULIAH.MATA_KULIAH = ''PRAKTIKUM SISTEM DIGITAL'' and MAHASISWA.NRP=FRS.NRP and FRS.ID_MK_TAWAR=MK_TAWAR.ID_MK_TAWAR and MATAKULIAH.ID_MK=MK_TAWAR.ID_MK\r\norder by MAHASISWA.NAMA ASC', 1, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(1156, 48, 65, 100, 'SELECT m.NAMA,f.NILAI_HURUF\r\nFROM MAHASISWA m,FRS f,MATAKULIAH mk,MK_TAWAR mkt\r\nWHERE f.NRP=m.NRP AND f.ID_MK_TAWAR=mkt.ID_MK_TAWAR AND mkt.ID_MK=mk.ID_MK AND mk.MATA_KULIAH=''PRAKTIKUM SISTEM DIGITAL'' AND mkt.tahun=''2002'' AND mkt.KELAS=''E'' AND ( m.AGAMA=''4'' OR m.AGAMA=''5'')\r\nORDER BY m.NAMA ASC', 1, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(1157, 48, 83, 100, 'select MAHASISWA.NAMA, FRS.NILAI_HURUF\r\nfrom MAHASISWA, FRS, MATAKULIAH, MK_TAWAR\r\nwhere MAHASISWA.AGAMA=5 and MK_TAWAR.TAHUN = ''2002'' and MK_TAWAR.KELAS = ''E'' and MATAKULIAH.MATA_KULIAH = ''PRAKTIKUM SISTEM DIGITAL'' and MAHASISWA.NRP=FRS.NRP and FRS.ID_MK_TAWAR=MK_TAWAR.ID_MK_TAWAR and MATAKULIAH.ID_MK=MK_TAWAR.ID_MK\r\nor MAHASISWA.AGAMA=4 and MK_TAWAR.TAHUN = ''2002'' and MK_TAWAR.KELAS = ''E'' and MATAKULIAH.MATA_KULIAH = ''PRAKTIKUM SISTEM DIGITAL'' and MAHASISWA.NRP=FRS.NRP and FRS.ID_MK_TAWAR=MK_TAWAR.ID_MK_TAWAR and MATAKULIAH.ID_MK=MK_TAWAR.ID_MK\r\norder by MAHASISWA.NAMA ASC', 1, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(1158, 49, 77, 0, 'SELECT DISTINCT MK_TAWAR.ID_MK_TAWAR, MATAKULIAH.MATA_KULIAH, MK_TAWAR.TAHUN\r\nFROM MK_TAWAR, MATAKULIAH\r\n  WHERE MK_TAWAR.DAYA_TAMPUNG < (SELECT AVG(MK_TAWAR.DAYA_TAMPUNG) FROM mk_tawar)\r\n  ORDER BY MK_TAWAR.id_mk_tawar', 1, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(1159, 71, 94, 0, 'select m.nama, n.nilai_huruf, n.nilai_angka, mt.mata_kuliah, mt.nilai_min\r\nfrom mahasiswa m, nilai n, matakuliah mt, mk_tawar mk\r\nwhere mk.semester = 1 and n.Nilai_huruf > mt.nilai_min and mk.ID_MK = MT.id_mk \r\nORDER BY M.NAMA ASC;', 1, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(1160, 70, 101, 100, 'select d.*\r\nfrom dosen d, mahasiswa m, frs s, mk_tawar mt\r\nwhere m.nama like ''___u%''and m.nrp=s.nrp and mt.id_mk_tawar= s.id_mk_tawar and d.nip=mt.nip\r\norder by d.nip asc;', 1, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(1161, 71, 91, 0, 'select distinct mhs.nama, f.nilai_huruf, mk.mata_kuliah, mk.nilai_min\r\nfrom mahasiswa mhs, frs f, matakuliah mk, mk_tawar mkt\r\nwhere mhs.nrp= f.nrp and f.id_mk_tawar= mkt.id_mk_tawar and mkt.id_mk= mk.id_mk and mkt.semester=''1'' and f.nilai_huruf > mk.nilai_min\r\norder by mhs.nama asc\r\n', 1, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(1162, 72, 91, 100, 'select distinct dsn.*\r\nfrom dosen dsn, mahasiswa mhs, frs f, matakuliah mk, mk_tawar mkt\r\nwhere  dsn.nip= mkt.nip and mkt.id_mk_tawar= f.id_mk_tawar and f.nrp=mhs.nrp and mk.id_mk=mkt.id_mk and mk.id_mk=''IF1409'' and f.nilai_huruf=''B''\r\norder by dsn.nip asc', 1, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(1163, 72, 101, 100, '/*medium*/  \r\nselect DISTINCT d.*\r\nfrom dosen d, mahasiswa m, frs f, matakuliah mt, mk_tawar mk\r\nwhere mk.id_mk=''IF1409'' and f.nilai_huruf=''B'' and m.nrp= f.nrp and mk.id_mk_tawar= f.id_mk_tawar and d.nip= mk.nip\r\norder by d.nip asc;', 1, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(1164, 73, 91, 0, 'select mk.*\r\nfrom mahasiswa mhs, matakuliah mk, mk_tawar mkt, frs f\r\nwhere mhs.nrp= f.nrp and f.id_mk_tawar= mkt.id_mk_tawar and mkt.id_mk=mk.id_mk and to_char(mhs.tgl_lhr,''MM'')=9\r\norder by mkt.id_mk_tawar asc', 1, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(1165, 72, 101, 100, 'select DISTINCT d.*\r\nfrom dosen d, mahasiswa m, frs f, matakuliah mt, mk_tawar mk\r\nwhere mk.id_mk=''IF1409'' and f.nilai_huruf=''B'' and m.nrp= f.nrp and mk.id_mk_tawar= f.id_mk_tawar and d.nip= mk.nip\r\norder by d.nip asc;', 1, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(1166, 70, 94, 100, 'select d.*\r\nfrom dosen d, mahasiswa m, frs f, mk_tawar mk\r\nwhere m.nama like ''___u%''  and m.nrp=f.nrp and f.id_mk_tawar=mk.id_mk_tawar and \r\nmk.nip=d.nip\r\nORDER BY D.NIP ASC;\r\n', 1, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(1167, 70, 100, 0, 'select * from dosen where nip in\r\n(select nip from mk_tawar where id_mk_tawar in\r\n(select id_mk_tawar from frs where nrp in\r\n(select nrp from mahasiswa where nama like ''___u%''))) order by nip asc;', 1, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(1168, 72, 100, 100, 'select * from dosen where nip in\r\n(select nip from mk_tawar where id_mk_tawar in\r\n(select id_mk_tawar from frs where id_mk_tawar in\r\n(select id_mk_tawar from mk_tawar where id_mk = ''IF1409'') and nilai_huruf = ''B'')) order by nip asc;', 1, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(1169, 73, 100, 0, 'select * from matakuliah where id_mk in\r\n(select id_mk from mk_tawar where id_mk_tawar in\r\n(select id_mk_tawar from frs where nrp in\r\n(select nrp from mahasiswa where to_char (tgl_lhr, ''mm'') = ''09''))) order by id_mk asc;', 1, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(1170, 72, 111, 100, 'select distinct d.*\r\nfrom dosen d, mahasiswa m, mk_tawar t, frs f\r\nwhere t.id_mk=''IF1409'' and t.id_mk_tawar= f.id_mk_tawar and m.nrp= f.nrp and f.nilai_huruf=''B'' and t.nip= d.nip\r\norder by d.nip asc;', 1, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(1171, 71, 111, 0, 'select DISTINCT m.nama, mk.mata_kuliah, f.nilai_huruf, mk.nilai_min\r\nfrom mahasiswa m, matakuliah mk, frs f, mk_tawar t\r\nwhere m.nrp= f.nrp and f.id_mk_tawar= t.id_mk_tawar and t.id_mk= mk.id_mk and t.semester=1 and f.nilai_huruf> mk.nilai_min\r\norder by m.nama asc;', 1, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(1172, 74, 111, 0, 'select distinct m.*\r\nfrom (select m.nrp, sum(n.nilai_angka* mk.sks)/sum(mk.sks) as IPS from mahasiswa m, frs f, nilai n, matakuliah mk, \r\n\r\nmk_tawar t where m.nrp = f.nrp and f.nilai_huruf = n.nilai_huruf and f.id_mk_tawar = t.id_mk_tawar and t.id_mk = mk.id_mk \r\n\r\ngroup by m.nrp) j, mahasiswa m, frs f, mk_tawar t\r\nwhere j.IPS > (select AVG(sum(n.nilai_angka* mk.sks)/sum(mk.sks)) from mahasiswa m, frs f, nilai n, matakuliah mk, \r\n\r\nmk_tawar t where m.nrp = f.nrp and f.nilai_huruf = n.nilai_huruf and f.id_mk_tawar = t.id_mk_tawar and t.id_mk = mk.id_mk \r\n\r\ngroup by m.nrp) and j.nrp = m.nrp and m.nrp = f.nrp and f.id_mk_tawar = t.id_mk_tawar and t.tahun = ''2001'' and t.semester \r\n\r\n= 2;', 1, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(1173, 70, 121, 100, 'select d.*\r\nfrom mahasiswa mhs, mk_tawar mt, frs f, dosen d\r\nwhere mhs.nama like ''___u%'' \r\nand f.id_mk_tawar = mt.id_mk_tawar and f.nrp = mhs.nrp and mt.terisi > 0 and d.nip = mt.nip order by mt.nip asc;\r\n', 1, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(1174, 70, 100, 0, 'select * from dosen where nip in\r\n(select nip from mk_tawar where id_mk_tawar in\r\n(select id_mk_tawar from frs where nrp in\r\n(select nrp from mahasiswa where nama like ''___u%''))) order by nip asc;', 1, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(1175, 72, 100, 100, 'select * from dosen where nip in\r\n(select nip from mk_tawar where id_mk_tawar in\r\n(select id_mk_tawar from frs where id_mk_tawar in\r\n(select id_mk_tawar from mk_tawar where id_mk = ''IF1409'') and nilai_huruf = ''B'')) order by nip asc;', 1, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(1176, 73, 100, 0, 'select * from matakuliah where id_mk in\r\n(select id_mk from mk_tawar where id_mk_tawar in\r\n(select id_mk_tawar from frs where nrp in\r\n(select nrp from mahasiswa where to_char (tgl_lhr, ''mm'') = ''09''))) order by id_mk asc;', 1, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(1177, 90, 58, 0, 'mas demsy', 1, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(1178, 90, 58, 100, 'select mk_tawar.tahun, mk_tawar.semester, count(frs.nrp) as jumlah_siswa, count(mk_tawar.kelas) as jumlahkelas \r\nfrom mk_tawar, frs, matakuliah \r\nwhere mk_tawar.id_mk_tawar = frs.id_mk_tawar and mk_tawar.id_mk = matakuliah.id_mk and matakuliah.mata_kuliah LIKE ''JARINGAN%'' \r\ngroup by mk_tawar.tahun, mk_tawar.semester\r\norder by mk_tawar.tahun;', 1, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(1179, 91, 58, 100, 'select mk_tawar.tahun, mk_tawar.semester, count(frs.nrp) as jumlah_siswa, count(mk_tawar.kelas) as jumlahkelas \r\nfrom mk_tawar, frs, matakuliah \r\nwhere mk_tawar.id_mk_tawar = frs.id_mk_tawar and mk_tawar.id_mk = matakuliah.id_mk and matakuliah.nilai_min < ''D'' and MOD(mk_tawar.tahun,2) = 1\r\ngroup by mk_tawar.tahun, mk_tawar.semester\r\norder by mk_tawar.TAHUN;', 1, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(1180, 92, 58, 100, 'select f.nrp , m.nama\r\nfrom frs f, mahasiswa m, mk_tawar t, matakuliah k\r\nwhere f.nrp = m.nrp and f.id_mk_tawar = t.id_mk_tawar\r\n	and t.id_mk = k.id_mk and substr(f.nrp,3, 2) =01\r\n	and f.id_mk_tawar IN\r\n		(select t.id_mk_tawar\r\n		 from mk_tawar t, matakuliah m\r\n		 where t.id_mk = m.id_mk and m.mata_kuliah = ''BASIS DATA'')\r\n	and f.id_mk_tawar NOT IN\r\n		(select t.id_mk_tawar\r\n		 from mk_tawar t, matakuliah m\r\n		 where t.id_mk = m.id_mk and m.mata_kuliah = ''BASIS DATA TERDISTRIBUSI'')\r\norder by f.nrp', 1, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(1181, 92, 58, 100, 'select f.nrp , m.nama\r\nfrom frs f, mahasiswa m, mk_tawar t, matakuliah k\r\nwhere f.nrp = m.nrp and f.id_mk_tawar = t.id_mk_tawar\r\n	and t.id_mk = k.id_mk and substr(f.nrp,3, 2) =01\r\n	and f.id_mk_tawar IN\r\n		(select t.id_mk_tawar\r\n		 from mk_tawar t, matakuliah m\r\n		 where t.id_mk = m.id_mk and m.mata_kuliah = ''BASIS DATA'')\r\n	and f.id_mk_tawar NOT IN\r\n		(select t.id_mk_tawar\r\n		 from mk_tawar t, matakuliah m\r\n		 where t.id_mk = m.id_mk and m.mata_kuliah = ''BASIS DATA TERDISTRIBUSI'')\r\norder by f.nrp', 1, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(1182, 93, 58, 100, 'select f.nrp\r\nfrom frs f, mahasiswa m, mk_tawar t, matakuliah k\r\nwhere f.nrp = m.nrp and f.id_mk_tawar = t.id_mk_tawar\r\n	and t.id_mk = k.id_mk and (substr(f.nrp,3, 2) = 98 or substr(f.nrp,3, 2) = 01 or substr(f.nrp,3, 2) = 00 or substr(f.nrp,3, 2) = 02)\r\n	and ( f.id_mk_tawar IN\r\n		(select t.id_mk_tawar\r\n		 from mk_tawar t, matakuliah m\r\n		 where t.id_mk = m.id_mk and m.mata_kuliah = ''BASIS DATA'')\r\n	and f.NRP IN\r\n		(select t.NRP\r\n		 from FRS t\r\n		 where t.NILAI_HURUF < ''C'' and t.ID_MK_TAWAR = ''imt1007''))\r\ngroup by f.NRP\r\nORDER BY f.NRP', 1, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(1183, 94, 58, 100, 'select NAMA, TGL_LHR\r\nfrom MAHASISWA\r\nwhere NRP in (select NRP \r\n              from FRS\r\n              where ID_MK_TAWAR not in (select ID_MK \r\n                                  from MK_TAWAR \r\n                                  where NIP not in (select NIP \r\n                                                    from MK_TAWAR\r\n                                                    where KELAS = ''A'')\r\n                                  and NIP in (select NIP \r\n                                              from MK_TAWAR\r\n                                              where DAYA_TAMPUNG > (select avg(DAYA_TAMPUNG) \r\n                                                                    from MK_TAWAR \r\n                                                                    where SEMESTER = 2))))\r\nand EXTRACT(YEAR from TGL_LHR) < 1985\r\norder by NAMA', 1, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(1184, 63, 48, 0, '  select distinct o.*, p.nilai_huruf\r\n    from (\r\n      select m.*\r\n      from frs m, nilai n\r\n      where m.nilai_huruf = n.nilai_huruf and n.nilai_angka > \r\n        ( select avg(nilai_angka)\r\n          from nilai)) p,\r\n      mk_tawar q, matakuliah o\r\n    where q.id_mk=o.id_mk and q.id_mk_tawar=p.id_mk_tawar;', 1, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(1185, 63, 48, 0, 'select distinct o.*, p.nilai_huruf\r\n    from (\r\n      select m.*\r\n      from frs m, nilai n\r\n      where m.nilai_huruf = n.nilai_huruf and n.nilai_angka > \r\n        ( select avg(nilai_angka)\r\n          from nilai)) p,\r\n      mk_tawar q, matakuliah o\r\n    where q.id_mk=o.id_mk and q.id_mk_tawar=p.id_mk_tawar\r\n    order by p.nilai_huruf desc;', 1, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(1186, 60, 24, 0, 'select *\r\nfrom mahasiswa\r\nwhere nrp in \r\n(select distinct id_mk_tawar\r\nfrom mk_tawar\r\nwhere id_mk in \r\n(select id_mk\r\nfrom matakuliah\r\nwhere mata_kuliah = ''ARSITEKTUR KOMPUTER'') and nip in (select nip\r\nfrom dosen\r\nwhere nama = ''Sarwosri, S.Kom''));', 1, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(1187, 61, 39, 0, 'SELECT DISTINCT M.NRP\r\nFROM MAHASISWA M,FRS F\r\nWHERE M.TEMPAT_LHR LIKE ''%Malang'' AND\r\n      M.NRP <> F.NRP\r\nORDER BY M.NRP DESC;', 1, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(1188, 61, 39, 0, 'SELECT DISTINCT M.NRP\r\nFROM MAHASISWA M,FRS F\r\nWHERE M.TEMPAT_LHR LIKE ''%Malang'' AND\r\n      M.NRP <> F.NRP\r\nORDER BY M.NRP DESC;', 1, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(1189, 61, 41, 0, 'select distinct frs.nrp from frs, mahasiswa where mahasiswa.nrp not in frs.nrp and mahasiswa.tempat_lhr like ''%Malang'' order by frs.nrp desc;', 1, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(1190, 61, 34, 100, 'SELECT m.nrp\r\nFROM mahasiswa m\r\nWHERE m.tempat_lhr like ''%Malang'' AND\r\n      m.nrp not in (SELECT m.nrp\r\n                    FROM frs f, mahasiswa m\r\n                    WHERE f.nrp=m.nrp)\r\nORDER BY m.nrp DESC;', 1, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(1191, 61, 39, 100, 'SELECT DISTINCT M.NRP\r\nFROM MAHASISWA M\r\nWHERE M.TEMPAT_LHR LIKE ''%Malang'' AND\r\n      M.NRP NOT IN (SELECT M.NRP\r\n                    FROM MAHASISWA M, FRS F\r\n                    WHERE M.NRP=F.NRP)\r\nORDER BY M.NRP DESC;', 1, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(1192, 61, 24, 0, 'select nrp\r\nfrom mahasiswa\r\nwhere nrp not in (select mahasiswa.nrp\r\nfrom mahasiswa, frs, mk_tawar\r\nwhere mahasiswa.nrp = frs.nrp and mk_tawar.id_mk_tawar = frs.id_mk_tawar)\r\nand(mahasiswa.tempat_lhr = ''Kota Malang'' or mahasiswa.tempat_lhr = ''Kabupaten Malang'');', 1, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(1193, 61, 24, 0, 'select nrp\r\nfrom mahasiswa\r\nwhere nrp not in (select mahasiswa.nrp\r\nfrom mahasiswa, frs, mk_tawar\r\nwhere mahasiswa.nrp = frs.nrp and mk_tawar.id_mk_tawar = frs.id_mk_tawar)\r\nand(mahasiswa.tempat_lhr = ''Kota Malang'' or mahasiswa.tempat_lhr = ''Kabupaten Malang'');', 1, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(1194, 61, 41, 0, 'select distinct mahasiswa.nrp from frs, mahasiswa where mahasiswa.nrp not in frs.nrp and mahasiswa.tempat_lhr like ''%Malang'' order by mahasiswa.nrp desc;', 1, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(1195, 61, 24, 100, 'select nrp\r\nfrom mahasiswa\r\nwhere nrp not in (select mahasiswa.nrp\r\nfrom mahasiswa, frs, mk_tawar\r\nwhere mahasiswa.nrp = frs.nrp and mk_tawar.id_mk_tawar = frs.id_mk_tawar)\r\nand(mahasiswa.tempat_lhr = ''Kota Malang'' or mahasiswa.tempat_lhr = ''Kabupaten Malang'')\r\norder by nrp desc;', 1, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(1196, 58, 41, 100, 'select distinct mahasiswa.nrp, mahasiswa.nama, mahasiswa.tempat_lhr from mahasiswa, frs where mahasiswa.nrp=frs.nrp and frs.nilai_huruf=''E'' order by mahasiswa.nrp desc;', 1, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(1197, 61, 41, 0, 'select distinct mahasiswa.nrp from mahasiswa, frs where mahasiswa.nrp!=frs.nrp and mahasiswa.tempat_lhr like ''%Malang'' order by mahasiswa.nrp desc;', 1, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(1198, 58, 57, 100, 'select distinct m.nrp, m.nama, m.tempat_lhr\r\nfrom mahasiswa m, frs f\r\nwhere f.nilai_huruf=''E'' and f.nrp= m.nrp\r\norder by nrp desc;', 1, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(1199, 59, 57, 0, 'select distinct d.*\r\nfrom dosen D, mk_tawar MT, matakuliah M\r\nwhere d.NIP=mt.NIP AND MT.id_mk=M.id_mk AND M.mata_kuliah=''SISTEM INFORMASI''\r\norder by d.nip desc;', 1, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(1200, 61, 41, 100, 'select distinct nrp from mahasiswa where nrp not in (select frs.nrp from frs) and tempat_lhr like ''%Malang'' order by mahasiswa.nrp desc;', 1, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(1201, 59, 57, 0, 'select distinct d.*\r\nfrom dosen D, mk_tawar MT, matakuliah M\r\nwhere d.NIP=mt.NIP AND MT.id_mk=M.id_mk AND M.mata_kuliah=''SISTEM INFORMASI''\r\norder by d.nip desc;', 1, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(1202, 59, 51, 0, 'select DISTINCT * \r\nfrom dosen , \r\n(select nip as nip2 from mk_tawar where id_mk in (select id_mk from matakuliah where mata_kuliah = ''SISTEM INFORMASI'')) ASS where dosen.nip = ASS.nip2 order by dosen.nip asc ;', 1, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(1203, 63, 34, 100, 'SELECT DISTINCT mk.*, f.nilai_huruf\r\nFROM matakuliah mk, nilai n, mk_tawar mt, frs f\r\nWHERE n.nilai_angka > (SELECT AVG(nilai_angka)\r\n                      FROM nilai) AND\r\n      f.nilai_huruf=n.nilai_huruf AND\r\n      f.id_mk_tawar=mt.id_mk_tawar AND\r\n      mt.id_mk=mk.id_mk\r\nORDER BY mk.id_mk ASC, f.nilai_huruf DESC;', 1, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(1204, 59, 51, 100, 'select DISTINCT dosen.* \r\nfrom dosen , \r\n(select nip as nip2 from mk_tawar where id_mk in (select id_mk from matakuliah where mata_kuliah = ''SISTEM INFORMASI'')) ASS where dosen.nip = ASS.nip2 order by dosen.nip asc ;', 1, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(1205, 63, 46, 0, 'select DISTINCT mk.*, f.nilai_huruf\nfrom mk_tawar mkt, matakuliah mk, frs f, (select f.id_mk_tawar as id_mkt, avg(n.nilai_angka) as \nfrom frs f, nilai n\nwhere n.nilai_huruf= f.nilai_huruf\ngroup by f.id_mk_tawar\nhaving avg(n.nilai_angka)>\n(select avg(nilai_angka)\nfrom nilai)) x\nwhere mkt.id_mk=mk.id_mk and f.id_mk_tawar= mkt.id_mk_tawar and mkt.id_mk_tawar=x.id_mkt\norder by f.nilai_huruf desc, mk.id_mk asc ;', 1, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(1206, 61, 46, 0, 'select DISTINCT m.nrp\r\nfrom mahasiswa m\r\nwhere m.tempat_lhr=''Malang'' or m.tempat_lhr=''Kabupaten Malang'' and  m.nrp not in\r\n(select f.nrp\r\nfrom frs f)\r\norder by m.nrp desc;', 1, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(1207, 59, 57, 100, 'select distinct d.*\r\nfrom dosen D, mk_tawar MT, matakuliah M\r\nwhere d.NIP=mt.NIP AND MT.id_mk=M.id_mk AND M.mata_kuliah=''SISTEM INFORMASI''\r\norder by d.nip asc;', 1, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(1208, 63, 46, 0, 'select DISTINCT mk.*, f.nilai_huruf\r\nfrom mk_tawar mkt, matakuliah mk, frs f, (select f.id_mk_tawar as id_mkt, avg(n.nilai_angka) as \r\nfrom frs f, nilai n\r\nwhere n.nilai_huruf= f.nilai_huruf\r\ngroup by f.id_mk_tawar\r\nhaving avg(n.nilai_angka)>\r\n(select avg(nilai_angka)\r\nfrom nilai)) x\r\nwhere mkt.id_mk=mk.id_mk and f.id_mk_tawar= mkt.id_mk_tawar and mkt.id_mk_tawar=x.id_mkt\r\norder by mk.id_mk asc, f.nilai_huruf desc;', 1, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(1209, 58, 51, 0, 'select mhs.nrp, mhs.nama, mhs.tgl_lhr \r\nfrom mahasiswa mhs, (select nrp as nrrp from mahasiswa where nrp in (select nrp from frs where nilai_huruf = ''E'')) urut \r\nwhere mhs.nrp = urut.nrrp order by mhs.nrp desc ;', 1, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(1210, 58, 51, 100, 'select mhs.nrp, mhs.nama, mhs.tempat_lhr \r\nfrom mahasiswa mhs, (select nrp as nrrp from mahasiswa where nrp in (select nrp from frs where nilai_huruf = ''E'')) urut \r\nwhere mhs.nrp = urut.nrrp order by mhs.nrp desc ;', 1, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(1211, 61, 46, 0, 'select DISTINCT m.nrp\r\nfrom mahasiswa m\r\nwhere m.tempat_lhr=''Malang'' or m.tempat_lhr=''Kabupaten Malang'' and  m.nrp not in\r\n(select f.nrp\r\nfrom frs f)\r\norder by m.nrp desc;\r\n', 1, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(1212, 60, 52, 100, 'SELECT DISTINCT mahasiswa.*\r\nfrom mahasiswa, frs f , mk_tawar mkt, dosen d , matakuliah m\r\nwhere mahasiswa.nrp = f.nrp and f.id_mk_tawar = mkt.id_mk_tawar and mkt.id_mk = m.id_mk and d.nip = mkt.nip and d.nip = ''132297166'' and m.mata_kuliah = ''ARSITEKTUR KOMPUTER''\r\norder by mahasiswa.nrp asc;', 1, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(1213, 61, 22, 100, 'SELECT NRP from mahasiswa where nrp not in(Select nrp from frs) and tempat_lhr like ''%Malang%'' ORDER BY NRP DESC;', 1, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(1214, 61, 28, 0, 'select distinct m.nrp\r\nfrom mahasiswa m, frs f\r\nwhere m.tempat_lhr like ''%Malang''\r\nand m.nrp not in f.nrp\r\norder by m.nrp desc;', 1, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(1215, 63, 22, 100, 'SELECT DISTINCT MATAKULIAH.*, FRS.NILAI_HURUF FROM FRS, NILAI, mk_tawar, MATAKULIAH WHERE FRS.nilai_huruf=NILAI.nilai_huruf AND  MK_TAWAR.ID_MK = MATAKULIAH.ID_MK AND FRS.id_mk_tawar = MK_TAWAR.id_mk_tawar AND NILAI.nilai_angka > (SELECT AVG(NILAI_ANGKA) FROM NILAI) ORDER BY MATAKULIAH.id_mk, FRS.nilai_huruf DESC;', 1, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(1216, 61, 38, 100, 'SELECT NRP\r\nFROM MAHASISWA\r\nWHERE NRP NOT IN (\r\n  SELECT NRP\r\n  FROM FRS\r\n)\r\nAND TEMPAT_LHR LIKE ''%Malang%''\r\nORDER BY NRP DESC;', 1, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00');
INSERT INTO `submission` (`id`, `question_id`, `users_id`, `nilai`, `jawaban`, `status`, `deleted_at`, `created_at`, `updated_at`) VALUES
(1217, 60, 23, 100, 'SELECT MAHASISWA.NRP, MAHASISWA.NAMA, MAHASISWA.JK, MAHASISWA.TGL_LHR, MAHASISWA.TEMPAT_LHR, MAHASISWA.AGAMA\r\nFROM MAHASISWA, FRS, MK_TAWAR, MATAKULIAH, DOSEN\r\nWHERE MAHASISWA.NRP = FRS.NRP AND FRS.ID_MK_TAWAR = MK_TAWAR.ID_MK_TAWAR AND MK_TAWAR.ID_MK = MATAKULIAH.ID_MK AND MK_TAWAR.NIP = DOSEN.NIP\r\nAND MATAKULIAH.MATA_KULIAH = ''ARSITEKTUR KOMPUTER'' AND DOSEN.NAMA = ''Sarwosri, S.Kom''\r\nORDER BY MAHASISWA.NRP;', 1, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(1218, 61, 23, 100, 'SELECT NRP\r\nFROM MAHASISWA\r\nWHERE TEMPAT_LHR LIKE ''%Malang%'' AND NRP NOT IN\r\n  (SELECT NRP\r\n  FROM FRS\r\n  )\r\nORDER BY NRP DESC;', 1, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(1219, 61, 28, 100, 'select distinct m.nrp\r\nfrom mahasiswa m\r\nwhere m.tempat_lhr like ''%Malang''\r\nand m.nrp not in (select nrp from frs)\r\norder by m.nrp desc;', 1, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(1220, 60, 51, 0, 'select mhs.nrp\r\nfrom mahasiswa mhs, (select nrp as nrp1 from mahasiswa where nrp not in(select nrp from frs) and tempat_lhr <> ''% Malang'') malang\r\nwhere mhs.nrp = malang.nrp1 order by mhs.nrp desc;', 1, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(1221, 60, 51, 100, 'select mhs.*\r\nfrom mahasiswa mhs, \r\n(select f.nrp as nrrp\r\nfrom frs f, (select id_mk_tawar as ide_mk from mk_tawar where NIP = (select NIP from dosen where nama = ''Sarwosri, S.Kom'') and id_mk in (select id_mk from matakuliah where mata_kuliah = ''ARSITEKTUR KOMPUTER'')) dosen\r\nwhere f.id_mk_tawar = dosen.ide_mk) dos\r\nwhere mhs.nrp = dos.nrrp order by mhs.nrp asc;', 1, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(1222, 60, 51, 100, 'select mhs.*\r\nfrom mahasiswa mhs, \r\n(select f.nrp as nrrp\r\nfrom frs f, (select id_mk_tawar as ide_mk from mk_tawar where NIP = (select NIP from dosen where nama = ''Sarwosri, S.Kom'') and id_mk in (select id_mk from matakuliah where mata_kuliah = ''ARSITEKTUR KOMPUTER'')) dosen\r\nwhere f.id_mk_tawar = dosen.ide_mk) dos\r\nwhere mhs.nrp = dos.nrrp order by mhs.nrp asc;', 1, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(1223, 63, 28, 100, 'select distinct m.*, f.nilai_huruf \r\nfrom frs f, matakuliah m, mk_tawar mk\r\nwhere f.id_mk_tawar = mk.id_mk_tawar\r\n  and m.id_mk = mk.id_mk\r\n  and f.nilai_huruf in \r\n  (select nilai_huruf\r\n  from nilai\r\n  where nilai_angka >\r\n    (select avg(nilai_angka)\r\n    from nilai))\r\norder by m.id_mk asc, f.nilai_huruf desc;', 1, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(1224, 61, 51, 0, 'select mhs.nrp\r\nfrom mahasiswa mhs, (select nrp as nrp1 from mahasiswa where nrp not in(select nrp from frs) and tempat_lhr <> ''% Malang'') malang\r\nwhere mhs.nrp = malang.nrp1 order by mhs.nrp desc;', 1, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(1225, 61, 51, 0, 'select mhs.nrp\r\nfrom mahasiswa mhs, (select nrp as nrp1 from mahasiswa where nrp not in(select nrp from frs) and tempat_lhr <> ''%Malang%'') malang\r\nwhere mhs.nrp = malang.nrp1 order by mhs.nrp desc;', 1, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(1226, 61, 51, 100, 'select mhs.nrp\r\nfrom mahasiswa mhs, (select nrp as nrp1 from mahasiswa where nrp not in(select nrp from frs) and tempat_lhr like ''%Malang%'') malang\r\nwhere mhs.nrp = malang.nrp1 order by mhs.nrp desc;', 1, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(1227, 63, 51, 0, 'select mhs.nrp\r\nfrom mahasiswa mhs, (select nrp as nrp1 from mahasiswa where nrp not in(select nrp from frs) and tempat_lhr like ''%Malang%'') malang\r\nwhere mhs.nrp = malang.nrp1 order by mhs.nrp desc;', 1, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(1228, 58, 20, 100, 'select distinct m.nrp, m.nama, m.tempat_lhr from mahasiswa m, frs f where m.nrp=f.nrp and f.nilai_huruf = ''E'' order by nrp desc;', 1, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(1229, 63, 51, 0, 'select distinct f.*\r\nfrom frs f,\r\n(select nil.nilai_huruf as diatas_rata\r\nfrom nilai nil,\r\n(SELECT avg(nilai_angka) as rat from nilai) rata\r\nwhere nil.nilai_angka > rata.rat) upper\r\nwhere f.nilai_huruf = upper.diatas_rata order by f.id_mk_tawar asc, f.nilai_huruf desc;', 1, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(1230, 61, 37, 100, 'select m.nrp\r\nfrom mahasiswa m\r\nwhere m.nrp not in (select nrp from frs) and m.tempat_lhr like ''%Malang%''\r\norder by m.nrp desc;\r\n', 1, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(1231, 59, 20, 0, 'select distinct d.* from dosen d, matakuliah m, mk_tawar mt where m.id_mk=mt.id_mk and m.mata_kuliah=''SISTEM INFORMASI'' order by d.nip asc;', 1, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(1232, 61, 47, 0, 'select m.*\r\nfrom\r\n  (select f.NRP\r\n  from\r\n    (select distinct a.id_mk_tawar\r\n    from\r\n      (select nip,id_mk_tawar\r\n        from\r\n        (select ID_MK\r\n          from matakuliah m\r\n          where m.mata_kuliah like ''ARSITEKTUR KOMPUTER'') a, mk_tawar m\r\n      where a.id_mk = m.id_mk) a,dosen d\r\n    where a.nip=d.nip and d.nama like ''Sarwosri, S.Kom'') a,frs f\r\n  where f.id_mk_tawar=a.id_mk_tawar) a, mahasiswa m\r\nwhere a.NRP=m.NRP\r\norder by m.nrp asc;', 1, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(1233, 61, 27, 100, 'select distinct m.nrp\r\nfrom mahasiswa m\r\nwhere m.nrp not in (select nrp from frs)\r\nand m.tempat_lhr like ''%Malang%''\r\norder by m.nrp desc;', 1, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(1234, 63, 47, 0, 'select m.*\r\nfrom\r\n    (select distinct m.id_mk\r\n    from\r\n      (select distinct f.*\r\n        from frs f\r\n        where f.nilai_huruf in\r\n        (select nilai_huruf\r\n          from nilai\r\n          where nilai_angka>\r\n            (select avg(nilai_angka)\r\n              from nilai))\r\n      order by f.nilai_huruf desc) a, mk_tawar m\r\n    where a.id_mk_tawar = m.id_mk_tawar)a , matakuliah m\r\nwhere a.id_mk= m.id_mk\r\norder by m.id_mk\r\n;', 1, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(1235, 63, 27, 100, 'select distinct mk.*, f.nilai_huruf\r\nfrom matakuliah mk, frs f, mk_tawar mt\r\nwhere f.id_mk_tawar= mt.id_mk_tawar\r\n  and mt.id_mk= mk.id_mk\r\n  and f.nilai_huruf in (select nilai_huruf from nilai where nilai_angka > (select avg(nilai_angka) from nilai))\r\norder by mk.id_mk asc, f.nilai_huruf desc;', 1, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(1236, 63, 23, 0, 'SELECT *\r\nFROM FRS, MK_TAWAR, MATAKULIAH, NILAI\r\nWHERE FRS.ID_MK_TAWAR = MK_TAWAR.ID_MK_TAWAR AND FRS.NILAI_HURUF = NILAI.NILAI_HURUF AND MK_TAWAR.ID_MK = MATAKULIAH.ID_MK \r\nAND NILAI.NILAI_ANGKA >\r\n  (SELECT AVG(NILAI.NILAI_ANGKA) FROM NILAI)\r\nORDER BY MK_TAWAR.ID_MK, NILAI.NILAI_HURUF DESC;', 1, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(1237, 61, 47, 100, 'select m.NRP\r\nfrom mahasiswa m\r\nwhere m.nrp not in\r\n  (select nrp\r\n    from frs)\r\n    and m.tempat_lhr like ''%Malang%''\r\norder by m.nrp desc;\r\n', 1, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(1238, 63, 23, 0, 'SELECT MATAKULIAH.MATA_KULIAH, NILAI.NILAI_HURUF\r\nFROM FRS, MK_TAWAR, MATAKULIAH, NILAI\r\nWHERE FRS.ID_MK_TAWAR = MK_TAWAR.ID_MK_TAWAR AND FRS.NILAI_HURUF = NILAI.NILAI_HURUF AND MK_TAWAR.ID_MK = MATAKULIAH.ID_MK \r\nAND NILAI.NILAI_ANGKA >\r\n  (SELECT AVG(NILAI.NILAI_ANGKA) FROM NILAI)\r\nORDER BY MK_TAWAR.ID_MK, NILAI.NILAI_HURUF DESC;', 1, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(1239, 59, 20, 0, 'select distinct d.* from dosen d, matakuliah m, mk_tawar mt where d.nip=mt.nip and m.mata_kuliah=''SISTEM INFORMASI'' order by d.nip asc;', 1, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(1240, 63, 38, 0, 'SELECT ID_FRS, NILAI_HURUF, NRP, ID_MK_TAWAR\r\nFROM \r\n  (\r\n  SELECT FRS.ID_FRS, FRS.NILAI_HURUF, FRS.NRP, FRS.ID_MK_TAWAR, NILAI.NILAI_ANGKA\r\n  FROM FRS, NILAI\r\n  WHERE FRS.nilai_huruf=NILAI.nilai_huruf\r\n  ORDER BY FRS.NILAI_HURUF DESC\r\n  ) TEMP\r\nWHERE TEMP.NILAI_ANGKA > \r\n(SELECT AVG(NILAI.NILAI_ANGKA)\r\nFROM NILAI)\r\nORDER BY ID_MK_TAWAR ASC;', 1, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(1241, 59, 20, 0, 'select distinct d.* from dosen d, matakuliah m, mk_tawar mt where d.nip=mt.nip and m.mata_kuliah=''SISTEM INFORMASI'' order by d.nip asc;', 1, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(1242, 61, 52, 100, 'select distinct m.nrp\r\nfrom mahasiswa m\r\nwhere m.nrp NOT IN \r\n(select m.nrp \r\nfrom mahasiswa m , frs f \r\nwhere m.nrp = f.nrp) and m.tempat_lhr like ''%Malang%''\r\norder by m.nrp desc;', 1, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(1243, 35, 49, 100, 'SELECT DISTINCT M.NAMA\r\nFROM MAHASISWA M, FRS F\r\nWHERE F.ID_MK_TAWAR IN\r\n	(SELECT MKT.ID_MK_TAWAR\r\n	FROM MK_TAWAR MKT\r\n	WHERE MKT.NIP =\r\n		(SELECT NIP\r\n		FROM DOSEN\r\n		WHERE NAMA = ''Rully Soelaiman''))\r\nAND M.NRP = F.NRP\r\nORDER BY M.NAMA;', 1, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(1244, 36, 49, 0, 'SELECT D.*\r\nFROM DOSEN D\r\nWHERE D.NIP IN\r\n	(SELECT MKT.NIP\r\n	FROM MK_TAWAR MKT\r\n	WHERE MKT.ID_MK_TAWAR IN\r\n		(SELECT F.ID_MK_TAWAR\r\n		FROM FRS F\r\n		WHERE F.NILAI_HURUF = ''B'')\r\n	AND MKT.ID_MK = ''IF1409'');\r\n', 1, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(1245, 37, 49, 0, 'SELECT M.*\r\nFROM MAHASISWA M\r\nWHERE M.NRP IN\r\n	(SELECT F.NRP, SUM(MK.SKS)\r\n	FROM FRS F, MK_TAWAR MKT, MATAKULIAH MK\r\n	WHERE F.ID_MK_TAWAR = MKT.ID_MK_TAWAR\r\n	AND MKT.ID_MK = MK.ID_MK\r\n	AND MKT.TAHUN = 2001\r\n	AND MKT.SEMESTER = 2\r\n	GROUP BY F.NRP\r\n	HAVING SUM(MK.SKS)>18);', 1, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(1246, 36, 49, 0, 'SELECT D.*\r\nFROM DOSEN D\r\nWHERE D.NIP IN\r\n	(SELECT MKT.NIP\r\n	FROM MK_TAWAR MKT\r\n	WHERE MKT.ID_MK_TAWAR IN\r\n		(SELECT F.ID_MK_TAWAR\r\n		FROM FRS F\r\n		WHERE F.NILAI_HURUF = ''B'')\r\n	AND MKT.ID_MK = ''IF1409'')\r\n5\r\nSELECT M.*\r\nFROM MAHASISWA M\r\nWHERE M.NRP IN\r\n	(SELECT F.NRP, SUM(MK.SKS)\r\n	FROM FRS F, MK_TAWAR MKT, MATAKULIAH MK\r\n	WHERE F.ID_MK_TAWAR = MKT.ID_MK_TAWAR\r\n	AND MKT.ID_MK = MK.ID_MK\r\n	AND MKT.TAHUN = 2001\r\n	AND MKT.SEMESTER = 2\r\n	GROUP BY F.NRP\r\n	HAVING SUM(MK.SKS)>18);\r\n', 1, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(1247, 36, 49, 0, '\r\nSELECT D.*\r\nFROM DOSEN D\r\nWHERE D.NIP IN\r\n	(SELECT MKT.NIP\r\n	FROM MK_TAWAR MKT\r\n	WHERE MKT.ID_MK_TAWAR IN\r\n		(SELECT F.ID_MK_TAWAR\r\n		FROM FRS F\r\n		WHERE F.NILAI_HURUF = ''B'')\r\n	AND MKT.ID_MK = ''IF1409'');', 1, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(1248, 59, 20, 100, 'select d.* from dosen d where nip in (select nip from mk_tawar where id_mk in (select id_mk from matakuliah where mata_kuliah = ''SISTEM INFORMASI''))\r\norder by nip asc;', 1, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(1249, 59, 45, 100, 'SELECT *\r\nFROM DOSEN\r\nWHERE NIP IN(SELECT NIP FROM MK_TAWAR WHERE ID_MK IN(SELECT ID_MK FROM MATAKULIAH WHERE MATA_KULIAH = ''SISTEM INFORMASI'')) \r\nORDER BY NIP ASC;', 1, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(1250, 63, 38, 0, 'SELECT ID_FRS, NILAI_HURUF, NRP, ID_MK_TAWAR\r\nFROM \r\n  (\r\n  SELECT FRS.ID_FRS, FRS.NILAI_HURUF, FRS.NRP, FRS.ID_MK_TAWAR, NILAI.NILAI_ANGKA\r\n  FROM FRS, NILAI\r\n  WHERE FRS.nilai_huruf=NILAI.nilai_huruf\r\n  ) TEMP\r\nWHERE TEMP.NILAI_ANGKA > \r\n(SELECT AVG(NILAI.NILAI_ANGKA)\r\nFROM NILAI)\r\nORDER BY ID_MK_TAWAR ASC, NILAI_HURUF DESC;\r\n', 1, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(1251, 60, 26, 100, 'SELECT MAH.NRP, MAH.NAMA, MAH.JK, MAH.TGL_LHR, MAH.TEMPAT_LHR, MAH.AGAMA\r\n  FROM MAHASISWA MAH, \r\n      (SELECT F.NRP as NRP\r\n        FROM FRS F,\r\n              (SELECT B.ID_MK_TAWAR as ID_MATA_KULIAH_TAWAR\r\n                FROM MATAKULIAH M, \r\n                               (SELECT ID_MK , ID_MK_TAWAR\r\n                                 FROM MK_TAWAR\r\n                                WHERE NIP=\r\n                                           (SELECT NIP\r\n                                            FROM DOSEN\r\n                                            WHERE NAMA=''Sarwosri, S.Kom''))B\r\n               WHERE MATA_KULIAH=''ARSITEKTUR KOMPUTER'' and M.ID_MK =B.ID_MK) KA\r\n        WHERE F.ID_MK_TAWAR=KA.ID_MATA_KULIAH_TAWAR) WO\r\n    WHERE MAH.NRP=WO.NRP\r\n    ORDER BY MAH.NRP ASC;', 1, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(1252, 61, 26, 0, 'SELECT DISTINCT M.NRP\r\n          FROM MAHASISWA M,\r\n                    (SELECT NRP\r\n                      FROM FRS)F\r\n          WHERE M.NRP NOT IN F.NRP and M.TEMPAT_LHR LIKE ''%Malang'' \r\n          ORDER BY M.NRP DESC;', 1, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(1253, 37, 49, 0, 'SELECT M.*\r\nFROM MAHASISWA M\r\nWHERE M.NRP IN\r\n	(SELECT F.NRP)\r\n	FROM FRS F, MK_TAWAR MKT, MATAKULIAH MK\r\n	WHERE F.ID_MK_TAWAR = MKT.ID_MK_TAWAR\r\n	AND MKT.ID_MK = MK.ID_MK\r\n	AND MKT.TAHUN = 2001\r\n	AND MKT.SEMESTER = 2\r\n	GROUP BY F.NRP\r\n	HAVING SUM(MK.SKS)>18);', 1, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(1254, 61, 26, 100, ' SELECT DISTINCT NRP\r\n          FROM MAHASISWA\r\n          WHERE TEMPAT_LHR LIKE ''%Malang'' and NRP NOT IN  \r\n                          (SELECT NRP\r\n                            FROM FRS)\r\n          ORDER BY NRP DESC;', 1, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(1255, 37, 49, 0, 'SELECT M.*\r\nFROM MAHASISWA M\r\nWHERE M.NRP IN\r\n	(SELECT F.NRP\r\n	FROM FRS F, MK_TAWAR MKT, MATAKULIAH MK\r\n	WHERE F.ID_MK_TAWAR = MKT.ID_MK_TAWAR\r\n	AND MKT.ID_MK = MK.ID_MK\r\n	AND MKT.TAHUN = 2001\r\n	AND MKT.SEMESTER = 2\r\n	GROUP BY F.NRP\r\n	HAVING SUM(MK.SKS)>18);', 1, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(1256, 63, 23, 0, 'SELECT MATAKULIAH.*, NILAI.NILAI_HURUF\r\nFROM FRS, MK_TAWAR, MATAKULIAH, NILAI\r\nWHERE FRS.ID_MK_TAWAR = MK_TAWAR.ID_MK_TAWAR AND FRS.NILAI_HURUF = NILAI.NILAI_HURUF AND MK_TAWAR.ID_MK = MATAKULIAH.ID_MK \r\nAND NILAI.NILAI_ANGKA >\r\n  (SELECT AVG(NILAI.NILAI_ANGKA) FROM NILAI)\r\nORDER BY MK_TAWAR.ID_MK, NILAI.NILAI_HURUF DESC;', 1, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(1257, 63, 23, 0, 'SELECT MATAKULIAH.*, NILAI.NILAI_HURUF\r\nFROM FRS, MK_TAWAR, MATAKULIAH, NILAI\r\nWHERE FRS.ID_MK_TAWAR = MK_TAWAR.ID_MK_TAWAR AND FRS.NILAI_HURUF = NILAI.NILAI_HURUF AND MK_TAWAR.ID_MK = MATAKULIAH.ID_MK \r\nAND NILAI.NILAI_ANGKA >\r\n  (SELECT AVG(NILAI.NILAI_ANGKA) FROM NILAI)\r\nORDER BY MK_TAWAR.ID_MK, NILAI.NILAI_HURUF DESC;', 1, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(1258, 37, 49, 0, 'SELECT DISTINCT M.*\r\nFROM MAHASISWA M\r\nWHERE M.NRP IN\r\n	(SELECT F.NRP\r\n	FROM FRS F, MK_TAWAR MKT, MATAKULIAH MK\r\n	WHERE F.ID_MK_TAWAR = MKT.ID_MK_TAWAR\r\n	AND MKT.ID_MK = MK.ID_MK\r\n	AND MKT.TAHUN = 2001\r\n	AND MKT.SEMESTER = 2\r\n	GROUP BY F.NRP\r\n	HAVING SUM(MK.SKS)>18)\r\nORDER BY M.NAMA;', 1, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(1259, 36, 49, 0, 'SELECT D.*\r\nFROM DOSEN D\r\nWHERE D.NIP IN\r\n	(SELECT MKT.NIP\r\n	FROM MK_TAWAR MKT\r\n	WHERE MKT.ID_MK_TAWAR IN\r\n		(SELECT F.ID_MK_TAWAR\r\n		FROM FRS F\r\n		WHERE F.NILAI_HURUF = ''B'')\r\n	AND MKT.ID_MK = ''IF1409'')\r\nORDER BY D.NAMA;\r\n', 1, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(1260, 36, 49, 0, 'SELECT DISTINCT D.*\r\nFROM DOSEN D\r\nWHERE D.NIP IN\r\n	(SELECT MKT.NIP\r\n	FROM MK_TAWAR MKT\r\n	WHERE MKT.ID_MK_TAWAR IN\r\n		(SELECT F.ID_MK_TAWAR\r\n		FROM FRS F\r\n		WHERE F.NILAI_HURUF = ''B'')\r\n	AND MKT.ID_MK = ''IF1409'');', 1, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(1261, 63, 51, 0, 'select distinct matkul.*, f.nilai_huruf \nfrom frs f, matakuliah matkul,\n(select nil.nilai_huruf as diatas_rata\nfrom nilai nil,\n(SELECT avg(nilai_angka) as rat from nilai) rata\nwhere nil.nilai_angka > rata.rat) upper\nwhere f.nilai_huruf = upper.diatas_rata order by matkul.id_mk asc, f.nilai_huruf desc;', 1, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(1262, 37, 49, 100, 'SELECT DISTINCT M.NAMA\r\nFROM MAHASISWA M\r\nWHERE M.NRP IN\r\n	(SELECT F.NRP\r\n	FROM FRS F, MK_TAWAR MKT, MATAKULIAH MK\r\n	WHERE F.ID_MK_TAWAR = MKT.ID_MK_TAWAR\r\n	AND MKT.ID_MK = MK.ID_MK\r\n	AND MKT.TAHUN = 2001\r\n	AND MKT.SEMESTER = 2\r\n	GROUP BY F.NRP\r\n	HAVING SUM(MK.SKS)>18)\r\nORDER BY M.NAMA;', 1, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(1263, 60, 20, 100, 'select distinct m.* \r\nfrom mahasiswa m, matakuliah mk, dosen d, frs f, mk_tawar mt \r\nwhere m.nrp = f.nrp and mk.id_mk = mt.id_mk and mt.nip = d.nip and mt.id_mk_tawar = f.id_mk_tawar \r\nand  mk.mata_kuliah=''ARSITEKTUR KOMPUTER'' and d.nama = ''Sarwosri, S.Kom'' order by m.nrp asc;', 1, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(1264, 60, 53, 0, 'select m.nama,m.nrp,m.jk,m.tgl_lhr,m.tempat_lhr,m.agama\r\nfrom mahasiswa m,dosen d,matakuliah mt, mk_tawar mk,frs f\r\nwhere f.id_mk_tawar=mk.id_mk_tawar and mk.nip=d.nip and mt.id_mk=mk.id_mk and f.nrp=m.nrp and mt.mata_kuliah=''ARSITEKTUR KOMPUTER'' and d.nama=''Sarwosri, S.Kom''\r\ngroup by m.nama,m.nrp,m.jk,m.tgl_lhr,m.tempat_lhr,m.agama\r\norder by nrp;', 1, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(1265, 63, 53, 0, 'select m.id_mk,m.mata_kuliah,m.sks,m.nilai_min,f.nilai_huruf,n.nilai_angka\r\nfrom matakuliah m,nilai n,frs f,mk_tawar mk,(select avg(nilai_angka)\r\nas rata from nilai) r\r\nwhere n.nilai_huruf=f.nilai_huruf and m.id_mk=mk.id_mk and\r\nmk.id_mk_tawar=f.id_mk_tawar and n.nilai_angka>r.rata\r\norder by m.id_mk asc, f.nilai_huruf desc', 1, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(1266, 61, 53, 100, 'SELECT nrp\r\nFROM mahasiswa\r\nWHERE NRP NOT IN (SELECT NRP FROM frs) and tempat_lhr like ''%Malang%''\r\nORDER BY NRP DESC', 1, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(1267, 63, 38, 0, 'SELECT MK.*, FRS2.NILAI_HURUF\r\nFROM matakuliah MK, mk_tawar MKT,\r\n  (\r\n  SELECT FRS.ID_FRS, FRS.NILAI_HURUF, FRS.NRP, FRS.ID_MK_TAWAR\r\n  FROM FRS, NILAI\r\n  WHERE FRS.nilai_huruf=NILAI.nilai_huruf\r\n  AND NILAI_ANGKA > \r\n  (SELECT AVG(NILAI.NILAI_ANGKA)\r\n  FROM NILAI)\r\n  ) FRS2\r\nWHERE MK.ID_MK=MKT.ID_MK\r\nAND MKT.ID_MK_TAWAR=FRS2.ID_MK_TAWAR\r\nORDER BY MK.ID_MK ASC, FRS2.NILAI_HURUF DESC;', 1, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(1268, 61, 18, 0, 'select distinct m.*\r\nfrom mahasiswa m, frs f\r\nwhere m.nrp not in (select f.nrp\r\n                    from frs f) and m.tempat_lhr like ''%Malang%''\r\norder by m.nrp DESC', 1, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(1269, 61, 18, 0, 'select distinct m.*\r\nfrom mahasiswa m, frs f\r\nwhere m.nrp not in (select f.nrp\r\n                    from frs f) and m.tempat_lhr like ''%Malang%''\r\norder by m.nrp DESC', 1, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(1270, 63, 38, 100, 'SELECT DISTINCT MK.*, FRS2.NILAI_HURUF\r\nFROM matakuliah MK, mk_tawar MKT,\r\n  (\r\n  SELECT FRS.ID_FRS, FRS.NILAI_HURUF, FRS.NRP, FRS.ID_MK_TAWAR\r\n  FROM FRS, NILAI\r\n  WHERE FRS.nilai_huruf=NILAI.nilai_huruf\r\n  AND NILAI_ANGKA > \r\n  (SELECT AVG(NILAI.NILAI_ANGKA)\r\n  FROM NILAI)\r\n  ) FRS2\r\nWHERE MK.ID_MK=MKT.ID_MK\r\nAND MKT.ID_MK_TAWAR=FRS2.ID_MK_TAWAR\r\nORDER BY MK.ID_MK ASC, FRS2.NILAI_HURUF DESC;', 1, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(1271, 58, 31, 100, 'select distinct m.nrp, m.nama, m.tempat_lhr\r\nfrom mahasiswa m, frs f\r\nwhere f.nilai_huruf=''E'' and f.nrp= m.nrp\r\norder by m.nrp desc;', 1, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(1272, 61, 18, 100, 'select distinct m.nrp\r\nfrom mahasiswa m, frs f\r\nwhere m.nrp not in (select f.nrp\r\n                    from frs f) and m.tempat_lhr like ''%Malang%''\r\norder by m.nrp DESC', 1, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(1273, 59, 31, 100, 'select distinct d.*\r\nfrom matakuliah mk, mk_tawar mt, dosen d\r\nwhere mk.mata_kuliah=''SISTEM INFORMASI'' and mt.id_mk=mk.id_mk and d.nip= mt.nip\r\norder by d.nip;', 1, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(1274, 60, 31, 100, 'select distinct m.*\r\nfrom mahasiswa m, matakuliah mk, mk_tawar mt, dosen d, frs f\r\nwhere mk.mata_kuliah=''ARSITEKTUR KOMPUTER'' and d.nama=''Sarwosri, S.Kom'' and\r\nmk.id_mk=mt.id_mk and mt.nip= d.nip and f.nrp=m.nrp and f.id_mk_tawar=mt.id_mk_tawar\r\norder by m.nrp;', 1, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(1275, 61, 31, 100, 'select DISTINCT m.nrp\r\nfrom mahasiswa m, frs f\r\nwhere m.tempat_lhr like ''%Malang%'' and  m.nrp not in\r\n(select f.nrp\r\nfrom frs f, mahasiswa m\r\nwhere f.nrp=m.nrp)\r\norder by m.nrp desc;', 1, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(1276, 59, 21, 100, 'Select *\r\nfrom DOSEN\r\nwhere NIP in (select NIP from MK_TAWAR where ID_MK in (select ID_MK from MATAKULIAH where MATA_KULIAH = ''SISTEM INFORMASI''))\r\norder by NIP asc;', 1, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(1277, 61, 20, 100, 'select m.nrp from mahasiswa m where m.nrp not in (select f.nrp from frs f) and tempat_lhr like ''%Malang%'' order by nrp desc;', 1, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(1278, 58, 50, 100, 'select distinct mhs.nrp, mhs.nama, mhs.tempat_lhr\r\nfrom mahasiswa mhs, frs f\r\nwhere f.nrp= mhs.nrp and f.nilai_huruf=''E''\r\norder by mhs.nrp desc;\r\n', 1, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(1279, 60, 53, 100, 'select m.nrp,m.nama,m.jk,m.tgl_lhr,m.tempat_lhr,m.agama\r\nfrom mahasiswa m,dosen d,matakuliah mt, mk_tawar mk,frs f\r\nwhere f.id_mk_tawar=mk.id_mk_tawar and mk.nip=d.nip and mt.id_mk=mk.id_mk and f.nrp=m.nrp and mt.mata_kuliah=''ARSITEKTUR KOMPUTER'' and d.nama=''Sarwosri, S.Kom''\r\ngroup by m.nama,m.nrp,m.jk,m.tgl_lhr,m.tempat_lhr,m.agama\r\norder by nrp;', 1, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(1280, 60, 37, 100, 'select mh.*\r\nfrom mahasiswa mh, dosen d, frs f, mk_tawar mk, matakuliah m\r\nwhere m.mata_kuliah=''ARSITEKTUR KOMPUTER'' and\r\n    d.nama = ''Sarwosri, S.Kom'' and\r\n    m.id_mk = mk.id_mk and\r\n    mk.nip = d.nip and\r\n    mh.nrp = f.nrp and\r\n    f.id_mk_tawar = mk.id_mk_tawar\r\n    order by mh.nrp asc;', 1, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(1281, 59, 50, 100, 'select distinct dsn.*\r\nfrom matakuliah mk, mk_tawar mkt, dosen dsn\r\nwhere mk.mata_kuliah=''SISTEM INFORMASI'' and dsn.nip= mkt.nip  and mkt.id_mk=mk.id_mk\r\norder by dsn.nip;', 1, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(1282, 60, 25, 0, 'select distinct m.*, d.nama, mk.mata_kuliah\r\nfrom mahasiswa m, matakuliah mk, mk_tawar mt, frs f, dosen d\r\nwhere d.nama=''Sarwosri, S.Kom'' and mk.mata_kuliah=''ARSITEKTUR KOMPUTER'' and mt.id_mk= mk.id_mk and mt.id_mk_tawar= f.id_mk_tawar and f.nrp= m.nrp\r\norder by m.nrp asc;', 1, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(1283, 60, 25, 0, 'select distinct m.*\r\nfrom mahasiswa m, matakuliah mk, mk_tawar mt, frs f, dosen d\r\nwhere d.nama=''Sarwosri, S.Kom'' and mk.mata_kuliah=''ARSITEKTUR KOMPUTER'' and mt.id_mk= mk.id_mk and mt.id_mk_tawar= f.id_mk_tawar and f.nrp= m.nrp\r\norder by m.nrp asc;', 1, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(1284, 60, 25, 100, 'select distinct m.*\r\nfrom mahasiswa m, matakuliah mk, mk_tawar mt, frs f, dosen d\r\nwhere d.nama=''Sarwosri, S.Kom'' and mk.mata_kuliah=''ARSITEKTUR KOMPUTER'' and mt.id_mk= mk.id_mk and mt.id_mk_tawar= f.id_mk_tawar and f.nrp= m.nrp and d.nip= mt.nip\r\norder by m.nrp asc;', 1, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(1285, 58, 30, 100, 'select distinct mah.nrp, mah.nama, mah.tempat_lhr\r\nfrom mahasiswa mah, frs f\r\nwhere f.nilai_huruf=''E'' and mah.nrp=f.nrp\r\norder by nrp desc;', 1, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(1286, 61, 49, 0, 'SELECT DISTINCT D.*\r\nFROM DOSEN D\r\nWHERE D.NIP IN\r\n	(SELECT MKT.NIP\r\n	FROM MK_TAWAR MKT\r\n	WHERE MKT.ID_MK_TAWAR IN\r\n		(SELECT F.ID_MK_TAWAR\r\n		FROM FRS F\r\n		WHERE F.NILAI_HURUF = ''B'')\r\n	AND MKT.ID_MK = ''IF1409'')\r\nORDER BY D.NAMA', 1, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(1287, 60, 29, 100, 'select *\r\nfrom mahasiswa\r\nwhere nrp in (select nrp\r\n              from frs\r\n              where id_mk_tawar in (select id_mk_tawar\r\n                                    from mk_tawar\r\n                                    where id_mk in (select id_mk\r\n                                                    from matakuliah\r\n                                                    where mata_kuliah like ''ARSITEKTUR KOMPUTER'') and nip in (select nip\r\n                                                                                                        from dosen\r\n                                                                                                        where nama like ''%Sarwosri%'')))\r\norder by nrp asc;', 1, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(1288, 59, 30, 100, 'select *\r\nfrom dosen\r\nwhere nip in (select nip\r\n		from mk_tawar\r\n		where id_mk in (select id_mk\r\n				from matakuliah\r\n				where mata_kuliah=''SISTEM INFORMASI''))\r\norder by nip asc;', 1, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(1289, 61, 29, 100, 'select nrp\r\nfrom mahasiswa\r\nwhere nrp not in (select nrp\r\n                  from frs)\r\n      and tempat_lhr like ''%Malang%''\r\norder by nrp desc;', 1, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(1290, 60, 30, 100, 'select *\r\nfrom mahasiswa\r\nwhere nrp in (select nrp\r\n		from frs\r\n		where id_mk_tawar in (select id_mk_tawar\r\n					from mk_tawar\r\n					where id_mk in (select id_mk\r\n							from matakuliah\r\n							where mata_kuliah=''ARSITEKTUR KOMPUTER'') and nip in (select nip\r\n													from dosen\r\n													where nama=''Sarwosri, S.Kom'')))\r\norder by nrp asc;', 1, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(1291, 60, 50, 100, 'select distinct mhs.*\r\nfrom mahasiswa mhs, matakuliah mk, mk_tawar mkt, dosen dsn, frs f\r\nwhere mk.mata_kuliah=''ARSITEKTUR KOMPUTER'' and dsn.nama=''Sarwosri, S.Kom'' and\r\nmk.id_mk=mkt.id_mk and mkt.nip= dsn.nip and f.nrp=mhs.nrp and f.id_mk_tawar=mkt.id_mk_tawar\r\norder by mhs.nrp;\r\n', 1, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(1292, 63, 29, 100, 'select distinct  m.*, f.nilai_huruf\r\nfrom matakuliah m, frs f, mk_tawar mk\r\nwhere f.nilai_huruf in (select nilai_huruf\r\n                        from nilai\r\n                        where nilai_angka > (select avg (nilai_angka) from nilai))\r\n      and mk.id_mk_tawar = f.id_mk_tawar\r\n      and m.id_mk=mk.id_mk\r\norder by m.id_mk asc, f.nilai_huruf desc;\r\n', 1, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(1293, 61, 30, 100, 'select nrp\r\nfrom mahasiswa\r\nwhere nrp not in (select nrp\r\n		from frs) and tempat_lhr like ''%Malang%''\r\norder by nrp desc;', 1, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(1294, 61, 50, 100, 'select DISTINCT mhs.nrp\r\nfrom mahasiswa mhs, frs f\r\nwhere mhs.tempat_lhr like ''%Malang%'' and  mhs.nrp not in\r\n(select f.nrp\r\nfrom frs f, mahasiswa mhs\r\nwhere f.nrp=mhs.nrp)\r\norder by mhs.nrp desc;', 1, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(1295, 63, 30, 100, 'select distinct mat.*, frs.nilai_huruf\r\nfrom matakuliah mat, nilai nil, frs frs, mk_tawar mk\r\nwhere nil.nilai_angka>(select avg(nilai_angka) from nilai) and nil.nilai_huruf=frs.nilai_huruf and frs.id_mk_tawar=mk.id_mk_tawar and mk.id_mk=mat.id_mk\r\norder by mat.id_mk asc, frs.nilai_huruf desc;', 1, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(1296, 36, 49, 0, 'SELECT DISTINCT D.*\r\nFROM DOSEN D\r\nWHERE D.NIP IN\r\n	(SELECT MKT.NIP\r\n	FROM MK_TAWAR MKT\r\n	WHERE MKT.ID_MK_TAWAR IN\r\n		(SELECT F.ID_MK_TAWAR\r\n		FROM FRS F\r\n		WHERE F.NILAI_HURUF = ''B'')\r\n	AND MKT.ID_MK = ''IF1409'')\r\nORDER BY D.NAMA', 1, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(1297, 63, 48, 100, '  select distinct o.*, p.nilai_huruf\r\n    from (\r\n      select m.id_mk_tawar, n.nilai_huruf\r\n      from frs m, nilai n\r\n      where m.nilai_huruf = n.nilai_huruf and n.nilai_angka > \r\n        ( select avg(nilai_angka)\r\n          from nilai)) p,\r\n      mk_tawar q, matakuliah o\r\n    where q.id_mk=o.id_mk and q.id_mk_tawar=p.id_mk_tawar\r\n    order by o.id_mk asc, p.nilai_huruf desc ;', 1, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(1298, 60, 21, 100, 'select *\r\nfrom MAHASISWA\r\nwhere NRP in (\r\n  select NRP \r\n  from FRS \r\n  where ID_MK_TAWAR in (\r\n    select ID_MK_TAWAR \r\n    from MK_TAWAR \r\n    where ID_MK in (\r\n      select ID_MK \r\n      from MATAKULIAH \r\n      where MATA_KULIAH = ''ARSITEKTUR KOMPUTER'') \r\n    AND NIP = (\r\n      select NIP \r\n      from DOSEN \r\n      where NAMA = ''Sarwosri, S.Kom'')))\r\norder by NRP asc;', 1, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(1299, 63, 23, 100, 'SELECT MATAKULIAH.ID_MK,MATAKULIAH.MATA_KULIAH,MATAKULIAH.SKS,MATAKULIAH.NILAI_MIN, NILAI.NILAI_HURUF\r\nFROM FRS, MK_TAWAR, MATAKULIAH, NILAI\r\nWHERE FRS.ID_MK_TAWAR = MK_TAWAR.ID_MK_TAWAR AND FRS.NILAI_HURUF = NILAI.NILAI_HURUF AND MK_TAWAR.ID_MK = MATAKULIAH.ID_MK \r\nAND NILAI.NILAI_ANGKA >\r\n    (SELECT AVG(NILAI.NILAI_ANGKA) \r\n    FROM NILAI)\r\nGROUP BY MATAKULIAH.ID_MK,MATAKULIAH.MATA_KULIAH,MATAKULIAH.SKS,MATAKULIAH.NILAI_MIN, NILAI.NILAI_HURUF\r\nORDER BY MATAKULIAH.ID_MK, NILAI.NILAI_HURUF DESC;', 1, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(1300, 36, 49, 0, 'SELECT DISTINCT D.*\r\nFROM DOSEN D\r\nWHERE D.NIP IN\r\n	(SELECT MKT.NIP\r\n	FROM MK_TAWAR MKT\r\n	WHERE MKT.ID_MK_TAWAR IN\r\n		(SELECT F.ID_MK_TAWAR\r\n		FROM FRS F\r\n		WHERE F.NILAI_HURUF = ''B'')\r\n	AND MKT.ID_MK = ''IF1409'')\r\nORDER BY D.NAMA', 1, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(1301, 60, 54, 0, 'SELECT *\r\nFROM MAHASISWA\r\nWHERE NRP IN (SELECT NRP FROM FRS WHERE ID_MK_TAWAR IN \r\n(SELECT ID_MK_TAWAR FROM MK_TAWAR WHERE ID_MK IN \r\n(SELECT ID_MK FROM MATAKULIAH WHERE mata_kuliah = ''ARSITEKTUR KOMPUTER'' HAVING NIP IN (SELECT NIP FROM dosen WHERE NAMA = ''Sarwosri, S.Kom''))))\r\nORDER BY NRP ASC', 1, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(1302, 61, 54, 100, 'select NRP\r\nfrom MAHASISWA\r\nwhere NRP NOT IN (SELECT NRP FROM FRS) AND TEMPAT_LHR LIKE ''%Malang%''\r\nORDER BY NRP DESC', 1, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(1303, 63, 54, 0, 'SELECT m.id_mk, m.mata_kuliah, m.sks, m.nilai_min, f.nilai_huruf, n.nilai_angka\r\nFROM matakuliah m, nilai n, frs f, mk_tawar mk,(SELECT AVG(nilai_angka)\r\nAS rata FROM nilai) r\r\nwhere n.nilai_huruf = f.nilai_huruf AND m.id_mk = mk.id_mk AND\r\nmk.id_mk_tawar = f.id_mk_tawar AND n.nilai_angka > r.rata\r\nORDER BY m.id_mk ASC, f.nilai_huruf DESC', 1, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(1304, 63, 26, 0, 'SELECT DISTINCT M.NRP, M.NAMA, M.JK, M.TGL_LHR, M.TEMPAT_LHR, M.AGAMA, KA.NILAI\r\n        FROM MAHASISWA M,\r\n                      (SELECT DISTINCT F.NRP , BA.NILAI\r\n                         FROM FRS F,\r\n                                    (SELECT B.NILAI_HURUF as NILAI\r\n                                      FROM NILAI B , \r\n                                                   (SELECT AVG(NILAI_ANGKA) as rata_rata\r\n                                                     FROM NILAI) A\r\n                                     WHERE B.NILAI_ANGKA > A.rata_rata) BA\r\n                       WHERE F.NILAI_HURUF IN BA.NILAI) KA\r\n        WHERE M.NRP IN KA.NRP;', 1, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(1305, 63, 54, 0, 'SELECT m.id_mk, m.mata_kuliah, m.sks, m.nilai_min, f.nilai_huruf\r\nFROM matakuliah m, nilai n, frs f, mk_tawar mk,(SELECT AVG(nilai_angka)\r\nAS rata FROM nilai) r\r\nwhere n.nilai_huruf = f.nilai_huruf AND m.id_mk = mk.id_mk AND\r\nmk.id_mk_tawar = f.id_mk_tawar AND n.nilai_angka > r.rata\r\nORDER BY m.id_mk ASC, f.nilai_huruf DESC;', 1, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(1306, 61, 21, 0, 'select NRP\r\nfrom MAHASISWA\r\nwhere NRP not in (select NRP from FRS)\r\nand TEMPAT_LHR = ''Kota Malang'' or TEMPAT_LHR = ''Kabupaten Malang''\r\norder by NRP desc;', 1, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(1307, 60, 36, 0, 'select distinct m.* \r\nfrom mahasiswa m, matakuliah mk, frs f, dosen d, mk_tawar mkt where mk.mata_kuliah = ''ARSITEKTUR KOMPUTER'' and mk.id_mk=mkt.id_mk and d.nama=''Sarwosri, S.Kom'' and m.nrp=f.nrp and d.nip=mkt.nip and mkt.id_mk=mk.id_mk \r\norder by (m.nrp) asc;\r\n', 1, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(1308, 61, 36, 100, 'select distinct nrp\r\n  from mahasiswa\r\n  where tempat_lhr like ''%Malang%'' and nrp not in\r\n  (select nrp\r\n  from frs)\r\n  order by(nrp) desc;', 1, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(1309, 61, 21, 100, 'select NRP\r\nfrom MAHASISWA\r\nwhere NRP not in (select NRP from FRS)\r\nand (TEMPAT_LHR = ''Kota Malang'' or TEMPAT_LHR = ''Kabupaten Malang'')\r\norder by NRP desc;', 1, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(1310, 63, 53, 0, 'select m.id_mk,m.mata_kuliah,m.sks,m.nilai_min,f.nilai_huruf\r\nfrom matakuliah m,nilai n,frs f,mk_tawar mk,(select avg(nilai_angka)\r\nas rata from nilai) r\r\nwhere n.nilai_huruf=f.nilai_huruf and m.id_mk=mk.id_mk and\r\nmk.id_mk_tawar=f.id_mk_tawar and n.nilai_angka>r.rata\r\norder by m.id_mk asc, f.nilai_huruf desc', 1, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(1311, 63, 47, 0, 'select m.*,a.nilai_huruf\r\nfrom matakuliah m,\r\n    (select m.id_mk,a.nilai_huruf\r\n    from\r\n      (select distinct f.id_mk_tawar, f.nilai_huruf, n.nilai_angka\r\n      from frs f, nilai n\r\n      where f.nilai_huruf = n.nilai_huruf\r\n      order by f.nilai_huruf desc) a, mk_tawar m\r\n    where a.nilai_angka > (select avg(nilai_angka) \r\n                          from (select f.id_mk_tawar, f.nilai_huruf, n.nilai_angka\r\n                                from frs f, nilai n\r\n                                where f.nilai_huruf = n.nilai_huruf\r\n                                order by f.nilai_huruf desc))\r\n      and a.id_mk_tawar = m.id_mk_tawar\r\n    order by m.id_mk asc) a\r\nwhere m.id_mk = a.id_mk\r\n;', 1, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(1312, 63, 47, 0, 'select distinct m.*,a.nilai_huruf\r\nfrom matakuliah m,\r\n    (select m.id_mk,a.nilai_huruf\r\n    from\r\n      (select distinct f.id_mk_tawar, f.nilai_huruf, n.nilai_angka\r\n      from frs f, nilai n\r\n      where f.nilai_huruf = n.nilai_huruf\r\n      order by f.nilai_huruf desc) a, mk_tawar m\r\n    where a.nilai_angka > (select avg(nilai_angka) \r\n                          from (select f.id_mk_tawar, f.nilai_huruf, n.nilai_angka\r\n                                from frs f, nilai n\r\n                                where f.nilai_huruf = n.nilai_huruf\r\n                                order by f.nilai_huruf desc))\r\n      and a.id_mk_tawar = m.id_mk_tawar\r\n    order by m.id_mk asc) a\r\nwhere m.id_mk = a.id_mk\r\n;', 1, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(1313, 61, 25, 100, 'select distinct m.nrp\r\nfrom mahasiswa m\r\nwhere m.nrp not in (select f.nrp from frs f) and m.tempat_lhr like ''%Malang%''\r\norder by m.nrp desc;', 1, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(1314, 63, 47, 0, 'select m.*,a.nilai_huruf\r\nfrom matakuliah m,\r\n    (select m.id_mk,a.nilai_huruf\r\n    from\r\n      (select f.id_mk_tawar, f.nilai_huruf, n.nilai_angka\r\n      from frs f, nilai n\r\n      where f.nilai_huruf = n.nilai_huruf\r\n      order by f.nilai_huruf desc) a, mk_tawar m\r\n    where a.nilai_angka > (select avg(nilai_angka) \r\n                          from (select f.id_mk_tawar, f.nilai_huruf, n.nilai_angka\r\n                                from frs f, nilai n\r\n                                where f.nilai_huruf = n.nilai_huruf\r\n                                order by f.nilai_huruf desc))\r\n      and a.id_mk_tawar = m.id_mk_tawar\r\n    order by m.id_mk asc) a\r\nwhere m.id_mk = a.id_mk\r\n;', 1, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(1315, 63, 36, 0, 'select mk.id_mk, mk.mata_kuliah, mk.sks, mk.nilai_min, f.nilai_huruf, n.nilai_angka \r\nfrom matakuliah mk, frs f, nilai n, mk_tawar mkt,\r\n(\r\nselect avg(nilai_angka) \r\nas x from nilai) r \r\nwhere n.nilai_huruf = f.nilai_huruf and mk.id_mk=mkt.id_mk and \r\nmkt.id_mk_tawar = f.id_mk_tawar and n.nilai_angka>r.x \r\norder by mk.id_mk asc, f.nilai_huruf desc;', 1, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(1316, 63, 47, 0, 'select m.*,a.nilai_huruf\r\nfrom matakuliah m,\r\n    (select m.id_mk,a.nilai_huruf\r\n    from\r\n      (select f.id_mk_tawar, f.nilai_huruf, n.nilai_angka\r\n      from frs f, nilai n\r\n      where f.nilai_huruf = n.nilai_huruf\r\n      order by f.nilai_huruf desc) a, mk_tawar m\r\n    where a.nilai_angka > (select avg(nilai_angka) \r\n                          from (select f.id_mk_tawar, f.nilai_huruf, n.nilai_angka\r\n                                from frs f, nilai n\r\n                                where f.nilai_huruf = n.nilai_huruf\r\n                                order by f.nilai_huruf desc))\r\n      and a.id_mk_tawar = m.id_mk_tawar\r\n    ) a\r\nwhere m.id_mk = a.id_mk\r\norder by m.id_mk\r\n;', 1, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(1317, 63, 47, 0, 'select distinct m.*,a.nilai_huruf\r\nfrom matakuliah m,\r\n    (select m.id_mk,a.nilai_huruf\r\n    from\r\n      (select f.id_mk_tawar, f.nilai_huruf, n.nilai_angka\r\n      from frs f, nilai n\r\n      where f.nilai_huruf = n.nilai_huruf\r\n      order by f.nilai_huruf desc) a, mk_tawar m\r\n    where a.nilai_angka > (select avg(nilai_angka) \r\n                          from (select f.id_mk_tawar, f.nilai_huruf, n.nilai_angka\r\n                                from frs f, nilai n\r\n                                where f.nilai_huruf = n.nilai_huruf\r\n                                order by f.nilai_huruf desc))\r\n      and a.id_mk_tawar = m.id_mk_tawar\r\n    ) a\r\nwhere m.id_mk = a.id_mk\r\norder by m.id_mk\r\n;', 1, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(1318, 63, 18, 0, 'create table jabatan\r\n(\r\n  id_jabatan char(5),\r\n  nama_jabatan varchar(20),\r\n  gaji integer,\r\n  primary key (id_jabatan)\r\n);\r\n\r\ncreate table petugas\r\n(\r\n  nip char(5),\r\n  id_jabatan char(5),\r\n  nama_petugas varchar(50),\r\n  nomor_hp_petugas varchar(13),\r\n  alamat_petugas varchar(200),\r\n  primary key (nip),\r\n  foreign key (id_jabatan) references jabatan \r\n);\r\n\r\ndrop table petugas\r\n\r\ncreate table pengirim\r\n(\r\n  id_pengirim char(7),\r\n  nama_pengirim varchar(30),\r\n  nomor_hp_pengirim varchar(13),\r\n  alamat_pengirim varchar(200),\r\n  id_jabatan char(5),\r\n  primary key (id_pengirim),\r\n  foreign key (id_jabatan) references jabatan\r\n);\r\n\r\ncreate table jenis_paket\r\n(\r\n  id_jenis_paket char(5) primary key,\r\n  nama_jenis_paket varchar(10),\r\n  keterangan_jenis_paket varchar(50),\r\n  bobot float(5)\r\n);\r\n\r\ncreate table tarif\r\n(\r\n  id_tarif char(5) primary key,\r\n  kota_asal varchar(30),\r\n  provinsi_asal varchar(30),\r\n  kota_tujuan varchar(30),\r\n  provinsi_tujuan varchar(30),\r\n  tarif_per_kilo integer\r\n)', 1, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(1319, 63, 18, 100, '\r\nselect distinct m.* , f.nilai_huruf\r\nfrom matakuliah m, frs f, mk_tawar mk, (SELECT avg(nil.nilai_angka) as rerata from nilai nil)verr, nilai n\r\nwhere m.id_mk=mk.id_mk and mk.id_mk_tawar=f.id_mk_tawar and f.nilai_huruf=n.nilai_huruf and n.nilai_angka > verr.rerata\r\norder by m.id_mk asc, f.nilai_huruf desc', 1, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(1320, 63, 37, 0, 'select mh.* , f.nilai_huruf\r\nfrom frs f, mk_tawar mk, matakuliah mh, nilai n\r\nwhere n.nilai_angka > (select avg(nilai_angka) from nilai)\r\n  and n.nilai_huruf = f.nilai_huruf \r\n  and f.id_mk_tawar = mk.id_mk_tawar\r\n  and mk.id_mk = mh.id_mk\r\norder by mh.id_mk, f.nilai_huruf desc;', 1, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(1321, 63, 46, 0, 'select DISTINCT mk.*, f.nilai_huruf\r\nfrom mk_tawar mkt, matakuliah mk, frs f, (select f.id_mk_tawar as id_mkt, avg(n.nilai_angka) as \r\nfrom frs f, nilai n\r\nwhere n.nilai_huruf= f.nilai_huruf\r\ngroup by f.id_mk_tawar\r\nhaving avg(n.nilai_angka)>\r\n(select avg(nilai_angka)\r\nfrom nilai)) x\r\nwhere mkt.id_mk=mk.id_mk and f.id_mk_tawar= mkt.id_mk_tawar and mkt.id_mk_tawar=x.id_mkt\r\norder by mk.id_mk asc, f.nilai_huruf desc;         \r\n', 1, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(1322, 63, 46, 0, 'select DISTINCT mk.*, f.nilai_huruf\r\nfrom mk_tawar mkt, matakuliah mk, frs f, (select f.id_mk_tawar as id_mkt, avg(n.nilai_angka) as \r\nfrom frs f, nilai n\r\nwhere n.nilai_huruf= f.nilai_huruf\r\ngroup by f.id_mk_tawar\r\nhaving avg(n.nilai_angka)>\r\n(select avg(nilai_angka)\r\nfrom nilai)) x\r\nwhere mkt.id_mk=mk.id_mk and f.id_mk_tawar= mkt.id_mk_tawar and mkt.id_mk_tawar=x.id_mkt\r\norder by mk.id_mk asc, f.nilai_huruf desc;         \r\n', 1, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(1323, 63, 18, 0, 'select m.* , f.nilai_huruf\r\nfrom matakuliah m, frs f, mk_tawar mk, (SELECT avg(nil.nilai_angka) as rerata from nilai nil)verr, nilai n\r\nwhere m.id_mk=mk.id_mk and mk.id_mk_tawar=f.id_mk_tawar and f.nilai_huruf=n.nilai_huruf and n.nilai_angka > verr.rerata\r\norder by m.id_mk asc, f.nilai_huruf desc', 1, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(1324, 61, 46, 0, 'select DISTINCT m.nrp\r\nfrom mahasiswa m\r\nwhere m.tempat_lhr=''Kota Malang'' or m.tempat_lhr=''Kabupaten Malang'' and  m.nrp not in\r\n(select f.nrp\r\nfrom frs f)\r\norder by m.nrp desc;', 1, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(1325, 63, 37, 0, 'select mh.* , f.nilai_huruf\r\nfrom frs f, mk_tawar mk, matakuliah mh, nilai n\r\nwhere n.nilai_angka > (select avg(nilai_angka) from nilai)\r\n  and n.nilai_huruf = f.nilai_huruf \r\n  and f.id_mk_tawar = mk.id_mk_tawar\r\n  and mk.id_mk = mh.id_mk\r\norder by mh.id_mk asc, f.nilai_huruf desc;', 1, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(1326, 63, 26, 100, 'SELECT DISTINCT M.*, LA.NILAI_HURUF\r\n        FROM MATAKULIAH M,\r\n            (SELECT MK.ID_MK , KA.NILAI_HURUF\r\n             FROM MK_TAWAR MK,\r\n                      (SELECT F.NILAI_HURUF , F.ID_MK_TAWAR\r\n                         FROM FRS F,\r\n                                    (SELECT B.NILAI_HURUF as NILAI\r\n                                      FROM NILAI B , \r\n                                                   (SELECT AVG(NILAI_ANGKA) as rata_rata\r\n                                                     FROM NILAI) A\r\n                                     WHERE B.NILAI_ANGKA > A.rata_rata) BA\r\n                       WHERE F.NILAI_HURUF IN BA.NILAI) KA\r\n             WHERE MK.ID_MK_TAWAR IN KA.ID_MK_TAWAR) LA\r\n        WHERE M.ID_MK IN LA.ID_MK\r\n        ORDER BY M.ID_MK ASC, LA.NILAI_HURUF DESC;', 1, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(1327, 61, 46, 100, 'select DISTINCT m.nrp\r\nfrom mahasiswa m\r\nwhere m.tempat_lhr like''%Malang'' and  m.nrp not in\r\n(select f.nrp\r\nfrom frs f)\r\norder by m.nrp desc;', 1, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(1328, 63, 18, 100, '\r\nselect distinct m.* , f.nilai_huruf\r\nfrom matakuliah m, frs f, mk_tawar mk, (SELECT avg(nil.nilai_angka) as rerata from nilai nil)verr, nilai n\r\nwhere m.id_mk=mk.id_mk and mk.id_mk_tawar=f.id_mk_tawar and f.nilai_huruf=n.nilai_huruf and n.nilai_angka > verr.rerata\r\norder by m.id_mk asc, f.nilai_huruf desc', 1, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(1329, 59, 35, 0, 'select DISTINCT * from dosen,\r\n(SELECT mk_tawar.nip from mk_tawar,\r\n(select matakuliah.id_mk AS matkul from matakuliah where mata_kuliah=''SISTEM INFORMASI'') ASS\r\nwhere mk_tawar.id_mk = ASS.matkul) ASS2\r\nwhere dosen.nip = ASS2.nip order by dosen.nip asc;', 1, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(1330, 60, 35, 0, 'select nama\r\nfrom mahasiswa,\r\n(select nrp\r\nfrom frs,\r\n(select nama,ASS2.tawar2 as tawar3\r\nfrom dosen,\r\n(select DISTINCT id_mk_tawar as tawar2, mk_tawar.nip from mk_tawar,\r\n(select id_mk AS id2 from matakuliah where mata_kuliah=''ARSITEKTUR KOMPUTER'')ASS  \r\nwhere mk_tawar.id_mk=ASS.id2)ASS2\r\nwhere dosen.nip = ASS2.nip and nama=''Sarwosri, S.Kom'')ASS3\r\nwhere frs.id_mk_tawar=ass3.tawar3)ASS4\r\nwhere mahasiswa.nrp= ASS4.nrp order by mahasiswa.nrp asc;', 1, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(1331, 61, 35, 0, 'select mahasiswa.nrp from mahasiswa where tempat_lhr like ''%Malang%'' and mahasiswa.nrp not in (select frs.nrp from frs);', 1, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(1332, 59, 42, 100, 'SELECT * \r\nFROM DOSEN \r\nWHERE NIP IN \r\n(SELECT NIP FROM MK_TAWAR WHERE ID_MK IN \r\n(SELECT ID_MK FROM MATAKULIAH WHERE MATA_KULIAH=''SISTEM INFORMASI'')) \r\nORDER BY NIP;', 1, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(1333, 61, 46, 100, 'select  m.nrp\r\nfrom mahasiswa m\r\nwhere m.tempat_lhr like''%Malang'' and  m.nrp not in\r\n(select nrp\r\nfrom frs )\r\norder by m.nrp desc;', 1, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(1334, 63, 54, 100, 'SELECT distinct m.id_mk, m.mata_kuliah, m.sks, m.nilai_min, f.nilai_huruf\r\nFROM matakuliah m, nilai n, frs f, mk_tawar mk,(SELECT AVG(nilai_angka)\r\nAS rata FROM nilai) r\r\nwhere n.nilai_huruf = f.nilai_huruf AND m.id_mk = mk.id_mk AND\r\nmk.id_mk_tawar = f.id_mk_tawar AND n.nilai_angka > r.rata\r\nORDER BY m.id_mk ASC, f.nilai_huruf DESC;', 1, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(1335, 60, 42, 100, 'SELECT * FROM MAHASISWA \r\nWHERE NRP IN \r\n(SELECT NRP FROM FRS WHERE ID_MK_TAWAR IN \r\n(SELECT ID_MK_TAWAR FROM MK_TAWAR WHERE ID_MK IN \r\n(SELECT ID_MK FROM MATAKULIAH WHERE MATA_KULIAH=''ARSITEKTUR KOMPUTER'') AND ID_MK_TAWAR IN (SELECT ID_MK_TAWAR FROM MK_TAWAR WHERE NIP IN (SELECT NIP FROM DOSEN WHERE NAMA=''Sarwosri, S.Kom''))))\r\nORDER BY NRP;', 1, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(1336, 63, 26, 100, 'SELECT DISTINCT M.*, LA.NILAI_HURUF\r\n        FROM MATAKULIAH M,\r\n            (SELECT MK.ID_MK , KA.NILAI_HURUF\r\n             FROM MK_TAWAR MK,\r\n                      (SELECT F.NILAI_HURUF , F.ID_MK_TAWAR\r\n                         FROM FRS F,\r\n                                    (SELECT B.NILAI_HURUF as NILAI\r\n                                      FROM NILAI B , \r\n                                                   (SELECT AVG(NILAI_ANGKA) as rata_rata\r\n                                                     FROM NILAI) A\r\n                                     WHERE B.NILAI_ANGKA > A.rata_rata) BA\r\n                       WHERE F.NILAI_HURUF IN BA.NILAI) KA\r\n             WHERE MK.ID_MK_TAWAR IN KA.ID_MK_TAWAR) LA\r\n        WHERE M.ID_MK IN LA.ID_MK\r\n        ORDER BY M.ID_MK ASC, LA.NILAI_HURUF DESC;', 1, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(1337, 63, 35, 0, 'select matakuliah.id_mk, matakuliah.mata_kuliah, matakuliah.sks, matakuliah.nilai_min, a.rata from matakuliah, (select matakuliah.id_mk, sum(nilai.nilai_angka* matakuliah.sks)/sum(matakuliah.sks) as rata from frs, matakuliah, mk_tawar, nilai where frs.id_mk_tawar=mk_tawar.id_mk_tawar and mk_tawar.id_mk=matakuliah.id_mk and frs.nilai_huruf=nilai.nilai_huruf group by matakuliah.id_mk) a where matakuliah.id_mk=a.id_mk and a.rata > (select sum(nilai.nilai_angka* matakuliah.sks)/sum(matakuliah.sks) from frs, matakuliah, mk_tawar, nilai where frs.id_mk_tawar=mk_tawar.id_mk_tawar and mk_tawar.id_mk=matakuliah.id_mk and frs.nilai_huruf=nilai.nilai_huruf) order by matakuliah.id_mk asc, a.rata desc;', 1, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(1338, 61, 46, 100, 'select nrp\r\nfrom mahasiswa \r\nwhere tempat_lhr like ''%Malang'' and nrp not in\r\n(select nrp\r\nfrom frs )\r\norder by nrp desc;', 1, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(1339, 63, 18, 100, 'select distinct m.* , f.nilai_huruf\r\nfrom matakuliah m, frs f, mk_tawar mk, (SELECT avg(nil.nilai_angka) as rerata from nilai nil)verr, nilai n\r\nwhere m.id_mk=mk.id_mk and mk.id_mk_tawar=f.id_mk_tawar and f.nilai_huruf=n.nilai_huruf and n.nilai_angka > verr.rerata\r\norder by m.id_mk asc, f.nilai_huruf desc', 1, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(1340, 63, 26, 100, 'SELECT DISTINCT M.*, LA.NILAI_HURUF\r\n        FROM MATAKULIAH M,\r\n            (SELECT MK.ID_MK , KA.NILAI_HURUF\r\n             FROM MK_TAWAR MK,\r\n                      (SELECT F.NILAI_HURUF , F.ID_MK_TAWAR\r\n                         FROM FRS F,\r\n                                    (SELECT B.NILAI_HURUF as NILAI\r\n                                      FROM NILAI B , \r\n                                                   (SELECT AVG(NILAI_ANGKA) as rata_rata\r\n                                                     FROM NILAI) A\r\n                                     WHERE B.NILAI_ANGKA > A.rata_rata) BA\r\n                       WHERE F.NILAI_HURUF IN BA.NILAI) KA\r\n             WHERE MK.ID_MK_TAWAR IN KA.ID_MK_TAWAR) LA\r\n        WHERE M.ID_MK IN LA.ID_MK\r\n        ORDER BY M.ID_MK ASC, LA.NILAI_HURUF DESC;', 1, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(1341, 61, 42, 100, 'SELECT NRP FROM MAHASISWA WHERE NRP NOT IN (SELECT NRP FROM FRS) AND TEMPAT_LHR LIKE ''%Malang%'' \r\nORDER BY NRP DESC; ', 1, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(1342, 63, 20, 0, 'select distinct mk.*, f.nilai_huruf \r\nfrom frs f, mk_tawar mt, nilai n, matakuliah mk\r\nwhere n.nilai_angka>(select avg(nilai_angka) from nilai) and n.nilai_huruf = f.nilai_huruf\r\nand mt.id_mk_tawar=f.id_mk_tawar and mt.id_mk=mk.id_mk order by mk.mata_kuliah asc, f.nilai_huruf desc;\r\n\r\n', 1, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(1343, 61, 46, 100, 'select nrp\r\nfrom mahasiswa \r\nwhere tempat_lhr like''%Malang'' and nrp not in\r\n(select nrp\r\nfrom frs )\r\norder by nrp desc;', 1, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00');
