(1348, 63, 18, 100, '\r\nselect distinct m.* , f.nilai_huruf\r\nfrom matakuliah m, frs f, mk_tawar mk, (SELECT avg(nil.nilai_angka) as rerata from nilai nil)verr, nilai n\r\nwhere m.id_mk=mk.id_mk and mk.id_mk_tawar=f.id_mk_tawar and f.nilai_huruf=n.nilai_huruf and n.nilai_angka > verr.rerata\r\norder by m.id_mk asc, f.nilai_huruf desc', 1, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(1349, 61, 46, 100, 'select nrp\r\nfrom mahasiswa \r\nwhere tempat_lhr like''%Malang'' and nrp not in\r\n(select nrp\r\nfrom frs )\r\norder by nrp desc;', 1, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(1350, 60, 32, 0, 'select distinct m.*, d.nama, mk.mata_kuliah\nfrom mahasiswa m, matakuliah mk, mk_tawar mt, frs f, dosen d\nwhere d.nama=''Sarwosri, S.Kom'' and \n    mk.mata_kuliah=''ARSITEKTUR KOMPUTER'' and \nf.nrp= m.nrp and \n    mt.id_mk= mk.id_mk and \n    mt.id_mk_tawar= f.id_mk_tawar and\n    d.nip= mt.nip\norder by m.nrp asc;', 1, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(1351, 60, 55, 0, ' select DISTINCT mahasiswa.*\r\nfrom mahasiswa, frs, mk_tawar, matakuliah, dosen\r\nwhere frs.nrp=mahasiswa.nrp\r\nand mk_tawar.id_mk=matakuliah.id_mk\r\nand matakuliah.mata_kuliah=''ARSITEKTUR KOMPUTER''\r\nand mk_tawar.nip=dosen.nip\r\nand dosen.nama=''Sarwosri, S.Kom''\r\norder by mahasiswa.nrp ASC', 1, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(1352, 63, 26, 100, '        SELECT DISTINCT M.*, LA.NILAI_HURUF\r\n        FROM MATAKULIAH M,\r\n            (SELECT MK.ID_MK , KA.NILAI_HURUF\r\n             FROM MK_TAWAR MK,\r\n                      (SELECT F.NILAI_HURUF , F.ID_MK_TAWAR\r\n                         FROM FRS F,\r\n                                    (SELECT B.NILAI_HURUF as NILAI\r\n                                      FROM NILAI B , \r\n                                                   (SELECT AVG(NILAI_ANGKA) as rata_rata\r\n                                                     FROM NILAI) A\r\n                                     WHERE B.NILAI_ANGKA > A.rata_rata) BA\r\n                       WHERE F.NILAI_HURUF IN BA.NILAI) KA\r\n             WHERE MK.ID_MK_TAWAR IN KA.ID_MK_TAWAR) LA\r\n        WHERE M.ID_MK IN LA.ID_MK\r\n        ORDER BY M.ID_MK ASC, LA.NILAI_HURUF DESC;', 1, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(1353, 63, 55, 0, 'select DISTINCT mk.id_mk, mk.mata_kuliah, mk.nilai_min, mk.sks, f.nilai_huruf\r\nfrom matakuliah mk, frs f, nilai n, mahasiswa m\r\nwhere f.nrp= m.nrp\r\nand n.nilai_angka > (select avg(nilai_angka) FROM nilai)\r\norder by mk.id_mk asc, f.nilai_huruf desc;', 1, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(1354, 61, 32, 100, 'select distinct m.nrp\r\nfrom mahasiswa m\r\nwhere m.nrp not in (select f.nrp from frs f) and m.tempat_lhr like ''%Malang%''\r\norder by m.nrp desc;', 1, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(1355, 61, 46, 100, 'select m.nrp\r\nfrom mahasiswa m \r\nwhere m.tempat_lhr like''%Malang'' and m.nrp not in\r\n(select f.nrp\r\nfrom frs f)\r\norder by m.nrp desc;', 1, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(1356, 63, 20, 0, 'select distinct mk.*, f.nilai_huruf \r\nfrom frs f, mk_tawar mt, nilai n, matakuliah mk\r\nwhere n.nilai_angka>(select avg(nilai_angka) from nilai) and n.nilai_huruf = f.nilai_huruf\r\nand mt.id_mk_tawar=f.id_mk_tawar and mt.id_mk=mk.id_mk order by mk.mata_kuliah asc, f.nilai_huruf desc;', 1, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(1357, 60, 36, 0, '\nPercakapan dibuka. 1 pesan belum dibaca.\n\nLewatkan ke konten\nMenggunakan Gmail dengan pembaca layar\nNurhamidah\nPenelusuran\n\n\n\nGmail\nTULIS\nLabel\nKotak Masuk (4)\nBerbintang\nPesan Terkirim\nDraf\nSelengkapnya \nHangouts\n\n \n \n \n  Lainnya \n1 dari 71  \n \nCetak semua Di jendela baru\nsbd 2 \nKotak Masuk\nx \n\nAviananda Dwirahma J <avianandadj@ymail.com>\nLampiran19.45 (5 menit yang lalu)\n\nke saya \nArea lampiran\nPratinjau lampiran SBD.txt\n\nTeks\nSBD.txt\n	\nKlik di sini untuk Balas atau Teruskan\n0,5 GB (3%) dari kuota 15 GB telah digunakan\nKelola\nPersyaratan - Privasi\nAktivitas akun terakhir: 26 menit yang lalu\nDetail\nAviananda Dwirahma J\n+ ke lingkaran\n\nTampilkan detail\n\n\n\nselect * \nfrom mahasiswa\nwhere nrp in \n(select nrp from frs shere id_mk_tawar in \n(select id_mk_tawar from mk_tawar where id_mk in\n(select id_mk from matakuliah where mata_kuliah = ''ARSITEKTUR KOMPUTER'' having nip in \n(select nip from dosen where nama = ''Sarwosri, S.Kom''))))', 1, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(1358, 63, 18, 100, '\r\nselect distinct m.* , f.nilai_huruf\r\nfrom matakuliah m, frs f, mk_tawar mk, (SELECT avg(nil.nilai_angka) as rerata from nilai nil)verr, nilai n\r\nwhere m.id_mk=mk.id_mk and mk.id_mk_tawar=f.id_mk_tawar and f.nilai_huruf=n.nilai_huruf and n.nilai_angka > verr.rerata\r\norder by m.id_mk asc, f.nilai_huruf desc', 1, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(1359, 60, 35, 100, 'select distinct mahasiswa.nrp, mahasiswa.nama, mahasiswa.jk, mahasiswa.tgl_lhr, mahasiswa.tempat_lhr, mahasiswa.agama\r\nfrom mahasiswa,\r\n(select nrp\r\nfrom frs,\r\n(select nama,ASS2.tawar2 as tawar3\r\nfrom dosen,\r\n(select DISTINCT id_mk_tawar as tawar2, mk_tawar.nip from mk_tawar,\r\n(select id_mk AS id2 from matakuliah where mata_kuliah=''ARSITEKTUR KOMPUTER'')ASS  \r\nwhere mk_tawar.id_mk=ASS.id2)ASS2\r\nwhere dosen.nip = ASS2.nip and nama=''Sarwosri, S.Kom'')ASS3\r\nwhere frs.id_mk_tawar=ass3.tawar3)ASS4\r\nwhere mahasiswa.nrp= ASS4.nrp order by mahasiswa.nrp asc;', 1, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(1360, 59, 35, 100, 'select DISTINCT dosen.nip , dosen.nama , dosen.tempat_lhr, dosen.tgl_lhr, dosen.jk , dosen.alamat, dosen.telp , dosen.email, dosen.jurusan from dosen,\r\n(SELECT mk_tawar.nip from mk_tawar,\r\n(select matakuliah.id_mk AS matkul from matakuliah where mata_kuliah=''SISTEM INFORMASI'') ASS\r\nwhere mk_tawar.id_mk = ASS.matkul) ASS2\r\nwhere dosen.nip = ASS2.nip order by dosen.nip asc;', 1, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
