(1386, 63, 18, 100, '\r\nselect distinct m.* , f.nilai_huruf\r\nfrom matakuliah m, frs f, mk_tawar mk, (SELECT avg(nil.nilai_angka) as rerata from nilai nil)verr, nilai n\r\nwhere m.id_mk=mk.id_mk and mk.id_mk_tawar=f.id_mk_tawar and f.nilai_huruf=n.nilai_huruf and n.nilai_angka > verr.rerata\r\norder by m.id_mk asc, f.nilai_huruf desc', 1, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(1387, 63, 20, 100, 'select distinct mk.*, f.nilai_huruf \r\nfrom frs f, mk_tawar mt, nilai n, matakuliah mk\r\nwhere n.nilai_angka>(select avg(nilai_angka) \r\nfrom nilai) and n.nilai_huruf = f.nilai_huruf\r\nand mt.id_mk_tawar=f.id_mk_tawar and mt.id_mk=mk.id_mk \r\norder by mk.id_mk asc, f.nilai_huruf desc;', 1, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(1388, 61, 57, 100, 'select DISTINCT nrp\r\nfrom mahasiswa\r\nwhere tempat_lhr like ''%Malang''AND nrp not in( select nrp from frs )\r\norder by nrp desc;', 1, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(1389, 63, 51, 0, 'select distinct matkul.id_mk as mat\r\nfrom mk_tawar matkul,\r\n(select distinct id_mk_tawar, f.nilai_huruf from frs f,\r\n(select nil.nilai_huruf as diatas_rata\r\nfrom nilai nil,\r\n(SELECT avg(nilai_angka) as rat from nilai) rata\r\nwhere nil.nilai_angka > rata.rat) upper\r\nwhere f.nilai_huruf = upper.diatas_rata) upper_matkul\r\nwhere upper_matkul.id_mk_tawar = matkul.id_mk_tawar;', 1, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(1390, 63, 47, 100, 'select distinct m.* , a.nilai_huruf\r\nfrom\r\n    (select m.id_mk, a.nilai_huruf\r\n    from\r\n      (select f.id_mk_tawar, f.nilai_huruf, n.nilai_angka\r\n      from frs f,nilai n\r\n      where n.nilai_angka >\r\n        (select avg(n.nilai_angka)\r\n        from nilai n\r\n       ) and f.nilai_huruf = n.nilai_huruf\r\n      order by f.nilai_huruf) a, mk_tawar m\r\n    where a.id_mk_tawar = m.id_mk_tawar) a, matakuliah m\r\nwhere a.id_mk = m.id_mk\r\norder by m.id_mk asc, a.nilai_huruf desc\r\n;', 1, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(1391, 63, 18, 100, '\r\nselect distinct m.* , f.nilai_huruf\r\nfrom matakuliah m, frs f, mk_tawar mk, (SELECT avg(nil.nilai_angka) as rerata from nilai nil)verr, nilai n\r\nwhere m.id_mk=mk.id_mk and mk.id_mk_tawar=f.id_mk_tawar and f.nilai_huruf=n.nilai_huruf and n.nilai_angka > verr.rerata\r\norder by m.id_mk asc, f.nilai_huruf desc', 1, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(1392, 63, 47, 100, 'select distinct m.* , a.nilai_huruf\r\nfrom\r\n    (select m.id_mk, a.nilai_huruf\r\n    from\r\n      (select f.id_mk_tawar, f.nilai_huruf, n.nilai_angka\r\n      from frs f,nilai n\r\n      where n.nilai_angka >\r\n        (select avg(n.nilai_angka)\r\n        from nilai n\r\n       ) and f.nilai_huruf = n.nilai_huruf\r\n      order by f.nilai_huruf) a, mk_tawar m\r\n    where a.id_mk_tawar = m.id_mk_tawar) a, matakuliah m\r\nwhere a.id_mk = m.id_mk\r\norder by m.id_mk asc, a.nilai_huruf desc\r\n;', 1, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(1393, 63, 18, 100, '\r\nselect distinct m.* , f.nilai_huruf\r\nfrom matakuliah m, frs f, mk_tawar mk, (SELECT avg(nil.nilai_angka) as rerata from nilai nil)verr, nilai n\r\nwhere m.id_mk=mk.id_mk and mk.id_mk_tawar=f.id_mk_tawar and f.nilai_huruf=n.nilai_huruf and n.nilai_angka > verr.rerata\r\norder by m.id_mk asc, f.nilai_huruf desc', 1, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(1394, 58, 19, 0, 'SELECT DISTINCT m.NRP,m.nama, m.tgl_lhr\nFROM MAHASISWA M,frs f\nWHERE m.nrp in (\nselect f.nrp\nfrom frs f\nwhere f.nilai_huruf = ''E'')\nORDER BY M.NRP DESC ;', 1, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(1395, 59, 19, 100, 'SELECT DISTINCT d.*\nFROM dosen d\nWHERE d.NIP in (\nselect m.NIP\nfrom mk_tawar m\nwhere ID_mk in (\nselect k.id_mk\nfrom matakuliah k\nwhere k.mata_kuliah = ''SISTEM INFORMASI''))\nORDER BY NIP ASC', 1, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(1396, 60, 56, 0, 'SELECT *\n  FROM MAHASISWA\n  WHERE NRP IN\n    (\n      SELECT NRP\n      FROM FRS\n      WHERE ID_MK_TAWAR IN\n        (\n          SELECT id_mk_tawar\n          FROM MK_TAWAR\n          WHERE ID_MK IN\n            (\n              SELECT ID_MK \n              FROM MATAKULIAH \n              WHERE MATA_KULIAH LIKE ''ARSITEKTUR KOMPUTER''\n            )\n            AND NIP IN \n              (\n                SELECT NIP\n                FROM DOSEN\n                WHERE NAMA LIKE ''Sarwosri, S.Kom''\n              )\n        )\n    );', 1, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(1397, 60, 19, 100, 'SELECT DISTINCT m.*\nFROM mahasiswa m, frs f, mk_tawar k\nWHERE f.id_mk_tawar = \n(\nSELECT DISTINCT k.id_mk_tawar\nFROM dosen d, mk_tawar k\nWHERE d.nama = ''Sarwosri, S.Kom'' and\n      d.NIP = k.NIP and\n      k.id_mk in \n      (\n      SELECT id_mk\n      FROM matakuliah\n      WHERE mata_kuliah = ''ARSITEKTUR KOMPUTER'' \n      )\n) and f.NRP = m.NRP\nORDER BY m.NRP ASC\n;', 1, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(1398, 61, 56, 100, 'SELECT DISTINCT NRP\r\nFROM MAHASISWA\r\nwhere NRP NOT IN \r\n  (\r\n    SELECT MAHASISWA.NRP  \r\n    from MAHASISWA , FRS \r\n    where MAHASISWA.NRP = FRS.NRP\r\n  ) \r\n  AND MAHASISWA.TEMPAT_LHR like ''%Malang%''\r\nORDER BY MAHASISWA.NRP DESC;', 1, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(1399, 61, 19, 0, 'SELECT m.NRP\r\nFROM mahasiswa m\r\nWHERE m.NRP not in\r\n(\r\nSELECT m.NRP\r\nFROM mahasiswa m, frs f\r\nWHERE m.NRP = f.NRP\r\n) and m.tempat_lhr like ''%Malang%'' ;\r\n', 1, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(1400, 63, 19, 100, 'SELECT DISTINCT k.*, f.nilai_huruf\r\nFROM matakuliah k, frs f, nilai n, mk_tawar s\r\nWHERE n.nilai_huruf = f.nilai_huruf \r\n      and n.nilai_angka > \r\n(      \r\nSELECT AVG(nilai_angka) \r\nFROM nilai\r\n) \r\nand s.id_mk_tawar = f.id_mk_tawar\r\nand k.id_mk = s.id_mk\r\nORDER BY k.id_mk, f.nilai_huruf DESC ;', 1, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(1401, 58, 19, 0, 'SELECT DISTINCT m.NRP,m.nama, m.tgl_lhr\r\nFROM MAHASISWA M,frs f\r\nWHERE m.nrp in (\r\nselect f.nrp\r\nfrom frs f\r\nwhere f.nilai_huruf = ''E'')\r\nORDER BY M.NRP DESC ;', 1, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00');
